INSERT INTO `info` VALUES ('1', 'img/infoImg/1.jpg', '广州黄埔区分千万级Telit项目再突破！', '黄埔区分千万级Telit项目再突破！\r\n  黄埔大企营服成功拓展自助售卖机龙头客户赤X科技，基于Telit平台的“安卓板+模组+连接+平台+应用”一体化方案深获客户认可，签约合同2千万\r\n一、客户需求痛点：广州赤X有限公司是某自助售货机设备生产商，该项目需求及痛点如下：\r\n1、由联通提供Telit平台，为客户提供千万级大并发数据处理，极大程度降低客户数据库负重，帮助客户搭建轻量级saas应用。\r\n2、客户传统模式单独采购RK3288系列安卓板、移远模组、物联网卡、云平台，采购费用较高，且项目开展效率较低。由联通总体打包，提供“沃芯模组+安卓板+连接+平台”智能平台套件，减少客户采购成本，提升上线效率，快速抢占市场；\r\n二、拓展要点：提供了“模组+安卓板+连接+平台”智能平台套件产品，以Telit平台为核心整合打包方式，降低套件成本。\r\n  市团队前期对自助售卖行业开展调研，自3月推出“安卓板+模组+连接+Telit平台”一体化标准产品后，广州已接连突破多个自助售卖项目，各单元下阶段可重点探索商机名单，地市工业互联网团队全力支撑！', '2019-05-02', '1', '222', '345', '209');
INSERT INTO `info` VALUES ('2', 'img/infoImg/2.jpg', '联通“退役军人一体化产品” 精彩亮相第二届数字中国建设峰会', '第二届数字中国建设峰会于5月6日在福建福州隆重开幕。中国联通以“联通5Gⁿ，让未来生长”为主题，携“5G、智慧城市、智慧产业”三大板块而来，以15项小类、37个前沿创新应用全面展示了中国联通在5G商用试点及创新业务探索上所取得的丰硕成果。联通系统集成有限公司以本次峰会为契机，全面推广展示自主创新产品，并深度参与智慧社会论坛、数字经济产业成果发布等重要活动环节，向社会各界充分展现了中国联通产业互联网领域取得的丰硕成果，赢得与会各方的高度评价。\r\n在联通产品展示区，全新升级的联通“五位一体”智能城市中枢解决方案再次成为参会嘉宾与观众关注的焦点。联通智能城市中枢解决方案是依托5G+ABCDEI等技术的融合运用，对“4+N”新型智慧城市方案的全面升级，涵盖感知中枢、信息中枢、AI中枢、指挥中枢与应用中枢，全力构建泛在智能的全面感知体系、开放共享的时空信息体系、精准协同的运行指挥体系、便捷普惠的民生服务体系、精细敏捷的城市治理体系、创新集聚的产业经济体系和宜居宜业的生态环境体系等七大体系，全面赋能新型智慧城市各个行业及领域的建设。\r\n联通系统集成有限公司自主打造的退役军人一体化平台产品方案被峰会选中，作为数字经济产业最新成果在成果展上权威发布。借此，进一步树立了“五新”联通的企业形象，巩固了公司在电子政务和智慧城市领域的行业地位。面向未来，联通系统集成有限公司将继续以领先的技术、创新的产品、丰富的应用，为城市提供源源不断的产业发展动力和持续竞争力，助力我国数字经济高质量发展。', '2014-07-06', '2', '57', '214', '321');
INSERT INTO `info` VALUES ('3', 'img/infoImg/3.jpg', '四川联通承建川内首家智慧云医院通过国家互联互通四级甲等测评', '2019年5月8日，系统集成四川省公司成功中标“四川省广元市精神卫生中心智慧云医院项目”，合同金额900万元，合同期三年。14日四川联通携合作方配合医院互联互通现场测评，国家卫健委专家组对联通在智慧云医院建设水平上给予高度评价，助力广元精神卫生中心顺利通过专家组初评，成为四川省内首家通过国家互联互通四级甲等测评的云上智慧医院。', '2019-05-02', '2', '146', '67', '78');
INSERT INTO `info` VALUES ('4', 'img/infoImg/4.jpg', ' 辽阳市分公司中标教育发展服务中心2019年标准化考点建设项目 ', '5月14日，辽宁省辽阳市分公司成功中标辽阳市教育发展服务中心2019年标准化考点建设项目，中标金额649.6万元。本项目以公开招标的形式采购，主要内容为辽阳市三所中学标准化考点建设，含校园网络系统改造、电子巡考系统建设、考场作弊防控系统建设、高考全覆盖系统改造、广播系统建设等。该项目的成功中标，巩固了辽阳市分公司在教育行业的优势地位，也为未来的项目推进奠定了有力基础。', '2019-03-21', '1', '65', '51', '311');
INSERT INTO `info` VALUES ('5', 'img/infoImg/5.jpg', '联通在线与亚胜公司签署手机保障项目合作协议', '2019年5月10日，联通在线信息科技有限公司与亚胜（中国）通讯技术服务有限公司在北京签署手机保障项目合作协议，共同打造极致的终端保障服务体验。联通在线党委书记、董事长、总经理马彦与亚胜公司亚太区首席执行官Jim Flautt出席了签约仪式并会谈，联通在线党委委员、副总经理刘鸿光与亚胜公司中国区首席执行官Windy Kohl代表双方签署项目合作协议。\r\n根据协议，双方将充分发挥各自优势，解决用户从“购机”、“用机”、“出现意外状况”、“手机升级更换”等手机使用场景中出现的问题，提供从精准化营销到换机服务的全流程终端保障体验。\r\n联通在线公司是中国联通面向消费互联网和家庭互联网创新领域设立的全资平台控股公司，整合运营商独有优势资源，创新八大核心能力，为公众互联网及家庭互联网用户提供统一的应用和内容入口，为广大客户创享美好智慧新生活。', '2019-02-08', '2', '43', '222', '156');
INSERT INTO `info` VALUES ('6', 'img/infoImg/6.jpg', '泰山景区与中国联通、百度地图共推“5G+智慧泰山”', '5月14日，泰山景区与中国联通、百度地图在泰山极顶签署战略合作框架协议，并揭牌“5G+智慧泰山联合实验室”及“泰山-百度地图智能旅游创新中心”。三方将以智慧旅游为导向，以智慧泰山为载体，通过实验室、研究院牵手合作，聚焦于5G+、物联网、人工智能、大数据及云计算技术应用，共同研究创新的智慧旅游解决方案，为全旅游产业发展提供强大驱动力。泰安市人民政府副市长成丽、泰安市文化和旅游局局长李华民、泰安市人民政府副秘书长田萌、泰山景区管委会主任王光锋、中国联通山东分公司副总经理韩冰、百度地图内容生态部&商务合作部总经理葛行飞出席签约仪式，并为“5G+智慧泰山联合实验室”、“泰山-百度地图智能旅游创新中心”揭牌。\r\n近年来，泰山景区积极顺应科技信息化发展潮流，把大数据、云计算、AI人工智能和物联网作为信息化发展的战略选择和主攻方向，强力推动数字景区向智慧景区转变，全力打造“智慧泰山”，数据采集与感知能力显著提升，应用生态环境日趋完善，应用机制不断优化，大数据、云计算服务精准营销、参与旅游管理的能力逐渐增强。尤其是自去年与海康威视成立智慧旅游研究院以来，在全国风景区行业内率先探索出了前沿科技与智慧旅游场景结合的合作模式，发挥了巨大应用价值，也起到了较好的示范作用。', '2019-03-08', '2', '289', '58', '156');
INSERT INTO `info` VALUES ('7', 'img/infoImg/7.jpg', '创新头条重点产品的三大推广激励政策', '政策一： 跨省成功签约项目补贴\r\n政策文件：关于印发《产业互联网产品研发及全国推广激励机制实施办法》的通知 （产互[2019]2号）\r\n适用范围：已列入产品目录的产品\r\n具体操作：\r\n1. 跨省项目由产品支撑单位负责收集落地产品的客户合同、支撑单位与使用单位的结算合同；\r\n2. 由支撑单位将合同关键信息上传至“创新头条”；\r\n3. 集团公司按季度与支撑单位签订服务支撑合同，按照客户合同中软件与服务金额10%的比例确定补贴金额并支付。\r\n政策二：重点产品销售激励\r\n政策文件：关于印发《产业互联网重点产品销售激励机制实施办法》的通知（产互[2019]13号）\r\n适用范围：集团发布的重点产品\r\n具体操作：\r\n1.由销售省公司提供“创新头条”平台“流程编号；\r\n2.集团公司每半年统计一次，按重点产品客户销售合同中软件与服务收入的10%，在年底省分考核时进行统筹考虑。', '2019-01-12', '3', '8', '111', '24');
INSERT INTO `info` VALUES ('8', 'img/infoImg/8.jpg', '四川联通成功中标四川省广元市精神卫生中心智慧云医院服务项目', '2019年5月8日，中国联通四川省分公司成功中标“四川省广元市精神卫生中心智慧云医院服务项目”，合同金额900万元，合同期三年。该项目是四川两地三中心标准架构的首例整体上云项目。2019年5月14日，中国联通医疗私有云助力客户顺利通过了国家医疗健康信息互联互通四级甲等测评，是省内第二家通过四级甲等测评的三甲医院，得到评审专家和客户的充分认可和高度评价。\r\n该项目历时一年多，项目团队克服了技术、资源、商务、恶意竞争、客情变化等重重困难，项目拓展中不断深化客情、多次优化方案，销售、支撑团队也不断成长，最终在集团总部、广东医疗基地的全力支持下成功中标。特别感谢集团政企部各位领导、医卫行业王路扬总、广东医疗基地高伟总等领导的精心指导与全力支持！\r\n项目的成功获取与实施，将在四川医疗行业形成口碑和标杆效应，四川省分公司将抓住契机、精心实施、组织项目复制！', '2019-05-03', '1', '323', '212', '189');
INSERT INTO `info` VALUES ('9', 'img/infoImg/9.jpg', '喜报！新疆联通成功中标塔里木河管理信息系统服务采购项目', '喜报！新疆联通成功中标塔里木河管理信息系统服务采购项目，中标金额2800万元，服务期为五年，该项目包含河湖长制平台、工业无人机巡河、高空瞭望监测等服务，集成整合塔河水资源、水质量、排污口、河道、断面项目管理、水情、雨情、污染举报等数据，为塔河流域化和行政化水资源管理措施制定、水污染防治规划、水环境预警预报、水生态健康评估提供平台技术支撑。\r\n2019年，新疆联通深耕生态环保领域，公司领导高度重视，多次拜访客户单位，在总部政企部、研究院、系统集成公司及云粒公司的鼎力支持下，成立跨多部门的项目组，聚焦塔河管理运营中的“痛点”问题，经过10个多月的不懈努力，最终确定项目落地。\r\n该项目是新疆联通实施的第一个“河长制”项目，下一步，新疆联通把塔河项目做成本省标杆，并不断将合作推向纵深，为博斯腾湖、台特马湖等众多河湖提供服务。', '2019-03-03', '1', '32', '231', '49');
INSERT INTO `info` VALUES ('10', 'img/infoImg/10.jpg', '广东联通重磅发布大湾区智能精品网 服务粤港澳大湾区 助力产业发展 ', '2019年5月7日，广东联通在联通新时空大厦举办“服务粤港澳大湾区，广东联通智能精品网发布会”，践行央企责任，坚决贯彻落实中共中央、国务院粤港澳大湾区发展规划纲要，继中国联通近日发布“5Gn让未来生长”品牌、宣布将正式开通5G试验网，广东联通联合联通国际公司、香港电信、澳门电讯、华为公司，结合多方力量和综合优势，面向粤港澳大湾区内的政府及金融、医疗、教育、制造等产业，重磅发布粤港澳大湾区一体化智能精品网产品，协同广东联通快速推进的5G网络建设和产业应用场景，全面升级大湾区基础通信设施，共同服务粤港澳大湾区发展战略.广东省工业和信息化厅、广东省通信管理局、联通国际公司、广东联通、香港电信公司、澳门电讯公司、华为公司领导以及政府与企业客户约350人参加此次发布会。\r\n纵览全球，湾区经济已经成为带动国家经济发展的重要增长引擎，彰显国际竞争力的新平台。粤港澳大湾区具有经济规模庞大、产业体系完备、创新主体高度集聚、环境开放包容等优势，有望成为世界一流的创新经济湾区。《粤港澳大湾区发展规划纲要》要求加快粤港澳大湾区基础设施互联互通，构建新一代信息基础设施、建成智慧城市群、提升网络安全保障水平，为经济社会发展提供有力支撑。', '2019-05-08', '2', '270', '370', '44');
INSERT INTO `info` VALUES ('11', 'img/infoImg/11.jpg', ' 联通集成公司成功中标天津市津南区信息中心视频监控运维项目 ', '5月6日，联通集成公司成功中标天津市津南区信息中心视频监控运维项目，中标金额6450.388万元。本次运维项目招标，在天津市津南分公司，集成天津分公司，集成公司总部各部门通力配合下，无论从标书制作，技术方案编写，还是现场述标，均得到了包括客户在内的评标专家的一致好评，并最终成功实现反抢，不仅确保3000余万元的CT收入，还为联通增加了3000余万元的运维服务收入。', '2018-08-18', '3', '100', '126', '289');
INSERT INTO `info` VALUES ('12', 'img/infoImg/12.jpg', '龙江医疗又传喜讯第一台相隔330公里的5G手术圆满成功', '龙江医疗又传喜讯第一台相隔330公里的5G手术圆满成功\r\n 4月29日14:30分，省内第一台相隔330公里的5G-MR远程指导手术拉开序幕,标志着龙江医疗与5G技术和人工智能的完美融合。\r\n病人由刘勇主任在七台河人民医院进行前列腺增生现场手术，卢德祥主任在省医院进行手术远程指导。前列腺增生是男性梗阻性排尿困难，无论年龄大小，无论富有贫困，其给患者带来的痛苦及烦恼都是巨大的。在我国现今医疗水平下，除去老式的开放手术外，我们通常选择经尿道微创手术来处理前列腺增生疾病，然而由于经济发展水平不同，医疗资源分配不平均，医护人员擅长的技术不同，许多相对经济发展落后地区的患者，无法获得更合适自己的治疗及手术方案。同样如果在4G网络下，由于网络延时，这是不可能实现的设想。而在5G网络下，端到端的时延不到20毫秒，可以完全保证双端手术的同步性。\r\n术前，两位主治医生已经借助MR（混合现实）技术将病人的病灶模型投射到空中，对病灶进行拆分、缩放、旋转、深度切割等术前模拟操作，共同制定了完善的手术方案。术中又将病灶模型1:1投影到病人身上，刘勇主任佩戴MR眼镜， 做手术如看透明人。同时，省医院卢德祥主任通过巨鲨8K高清屏幕，高清的画面和病人体征数据实时传送，保证了手术的异地同步展现。', '2019-01-01', '2', '356', '284', '193');
