INSERT INTO `member` VALUES ('1', '2019-05-26 16:00:00', '社会矛盾的变化', '4', '我国社会主要矛盾已经转化为人民日益增长的美好生活需要和不平衡不充分的发展之间的矛盾。习近平总书记在党的十九大作出的这一重大政治论断，是坚持辩证唯物主义和历史唯物主义的世界观方法论，坚持党的实事求是思想路线，通过历史和现实、理论和实践相结合的分析得出的正确结论，反映了我国社会发展的客观实际，丰富和发展了马克思主义矛盾学说，是我们党的重大理论创新成果。', '秦可卿', '2');
INSERT INTO `member` VALUES ('2', '2019-05-30 11:18:21', '党对一切工作的领导', '2', '党政军民学，东西南北中，党要领导人民实现伟大梦想，建设现代化强国，必须承担起领导一切的历史任务。习近平总书记在党的十九大报告中，把“坚持党对一切工作的领导”作为新时代坚持和发展中国特色社会主义基本方略中的第一条，赋予这一重大政治原则新的时代内涵与现实意义，指明了新时代党的建设的根本要求。正确理解这一思想，澄清模糊认识，对于深刻领会习近平新时代中国特色社会主义思想的精神实质和丰富内涵，并在各项工作中全面准确贯彻落实，具有重要意义。', '张三', '211');
INSERT INTO `member` VALUES ('3', '2019-04-20 00:00:00', '以人民为中心是新时代坚持和发展中国特色社会主义根本立场', '2', '人民群众是我们党的力量源泉，人民立场是中国共产党的根本政治立场。习近平总书记指出，“必须牢记我们的共和国是中华人民共和国，始终要把人民放在心中最高的位置，始终全心全意为人民服务，始终为人民利益和幸福而努力工作”。深入领会和牢牢坚守以人民为中心的根本立场，对于准确把握和全面贯彻习近平新时代中国特色社会主义思想，凝聚起实现“两个一百年”奋斗目标、实现中华民族伟大复兴中国梦的磅礴力量具有十分重要的意义。', '李四', '55');
INSERT INTO `member` VALUES ('4', '2019-05-01 00:00:00', '五四运动100周年', '1', '今年是五四运动100周年，也是中华人民共和国成立70周年。在这个具有特殊意义的历史时刻，我们在这里隆重集会，缅怀五四先驱崇高的爱国情怀和革命精神，总结党和人民探索实现民族复兴道路的宝贵经验，这对发扬五四精神，激励全党全国各族人民特别是新时代中国青年为全面建成小康社会、加快建设社会主义现代化国家、实现中华民族伟大复兴的中国梦而奋斗。', '王五', '512');
INSERT INTO `member` VALUES ('5', '2019-05-03 00:00:00', '新发展理念', '1', '坚持以人民为中心的发展思想，要坚定不移贯彻创新、协调、绿色、开放、共享的新发展理念。', '岑参', '51');
INSERT INTO `member` VALUES ('6', '2019-05-04 00:00:00', '中国联通积分助学计划', '3', '“中国联通积分助学计划”公益项目聚焦教育扶贫，围绕青少年成长各阶段，开展多样化公益捐助项目，首期执行项目为“积分助学计划之‘圆梦’行动”。', '柳宗元', '124');
INSERT INTO `member` VALUES ('7', '2019-05-08 00:00:00', '员工内外部交往纪律', '3', '《中国联通员工内外部交往纪律》根据党纪企规要求，聚焦全体员工内外部交往过程中需要特别强调并严厉禁止的突出问题，开列负面清单，划出了全体员工不可触碰的底线。我们必须深刻学习领会，进一步提高政治站位，自觉树牢四个意识、坚定四个自信、做到两个维护，将内容转化为工作思路，更好地为今后发展指明方向和路径，让《中国联通员工内外部交往纪律》落地生根、开花结果', '姜夔', '120');
INSERT INTO `member` VALUES ('8', '2019-05-14 00:00:00', '决胜全面建成小康社会', '3', '全面建成小康社会，是我们党向人民、向历史作出的庄严承诺，是13亿多中国人民的共同期盼。这个宏伟目标，是“两个一百年”奋斗目标的第一个百年奋斗目标，是中华民族伟大复兴征程上的一座重要里程碑。从现在到2020年，是全面建成小康社会决胜期，既要坚定必胜的信心，又要激励攻坚克难的斗志，靠苦干实干，如期高质量全面建成小康社会，为开启全面建设社会主义现代化国家新征程奠定坚实基础。', '孔明', '9');
INSERT INTO `member` VALUES ('9', '2019-05-16 00:00:00', '实现我国经济高质量发展', '4', '我国经济已由高速增长阶段转向高质量发展阶段，必须在习近平新时代中国特色社会主义思想特别是经济思想指引下，加快形成推动高质量发展的指标体系、政策体系、标准体系、统计体系、绩效评价、政绩考核，创建和完善制度环境，推动我国经济在实现高质量发展上不断取得新进展。', '公瑾', '59');
INSERT INTO `member` VALUES ('10', '2019-03-31 00:00:00', '全面开放新格局', '4', '当前，面对复杂的内外形势，中国需要形成全方位、多层次、宽领域的全面开放新格局，进而有效推动国内各项改革进程，找到解决发展中所面临问题的合理方案。。。。。。', '孟德', '32');
INSERT INTO `member` VALUES ('11', '2019-03-01 00:00:00', '基本路线', '1', '中国共产党在社会主义初级阶段的基本路线是：领导和团结全国各族人民，以经济建设为中心，坚持四项基本原则，坚持改革开放，自力更生，艰苦创业，为把我国建设成为富强民主文明和谐美丽的社会主义现代化强国而奋斗。', '玄德', '102');
INSERT INTO `member` VALUES ('12', '2019-04-04 00:00:00', '人民当家作主 ', '2', '人民当家作主是我们党矢志不渝的奋斗目标', '翼德', '416');
INSERT INTO `member` VALUES ('13', '2019-03-08 00:00:00', '新的历史方位', '1', '中国特色社会主义进入了新时代，这是我国发展新的历史方位。这一重大政治论断，赋予党的历史使命、理论遵循、目标任务新的时代内涵，为深刻把握当代中国发展变革的新特征，增强贯彻落实习近平新时代中国特色社会主义思想的自觉性坚定性，提供了时代坐标和科学依据，具有重大现实意义和深远历史意义。', '云长', '26');
INSERT INTO `member` VALUES ('14', '2019-02-08 00:00:00', '历史性变革和成就', '2', '党的十八大以来的5年，是党和国家发展进程中极不平凡的5年。5年来，以习近平同志为核心的党中央，以巨大的政治勇气和强烈的责任担当，进行伟大斗争、建设伟大工程、推进伟大事业、实现伟大梦想，提出一系列具有开创性意义的新理念新思想新战略，出台一系列重大方针政策，推出一系列重大举措，推进一系列重大工作，解决了许多长期想解决而没有解决的难题，办成了许多过去想办而没有办成的大事，推动党和国家事业发生历史性变革、取得历史性成就。', '文远', '300');
INSERT INTO `member` VALUES ('15', '2019-02-09 00:00:00', '新征程', '1', '党的十九大明确提出，在全面建成小康社会的基础上，分两步走，到本世纪中叶把我国建成富强民主文明和谐美丽的社会主义现代化强国。习近平总书记指出，这是新时代中国特色社会主义发展的战略安排。要把这一重大战略安排的美好蓝图变为现实，必须以习近平新时代中国特色社会主义思想为指引，深入贯彻落实党的十九大的决策部署，坚忍不拔、锲而不舍，决胜全面建成小康社会，奋力开启全面建设社会主义现代化国家新征程。', '仲谋', '200');
