INSERT INTO `notice` VALUES ('37', '2016-03-17 00:00:00', '信息化部', '关于钓鱼邮件事件的通告', '<p style=\"text-indent: 2em;\" align=\"left\">各位领导同事，大家好：</p>\n<p style=\"text-indent: 2em;\">近期邮件系统维护组在日常监控过程中发现，有广东、辽宁、吉林等地企业邮箱用户，因其办公终端被病毒侵害或邮箱密码泄漏，导致不法人员通过企业邮箱向集团内部用户发送大量钓鱼邮件，为避免用户信息泄露导致不必要损失，我们已经在邮件系统公网出口对此类出站邮件进行拦截。并对涉嫌发送该类钓鱼邮件的账户进行了禁用、病毒查杀，修改高复杂度密码等操作。</p>\n<p style=\"text-indent: 2em;\"><strong>为避免用户信息泄露，特提醒用户注意以下钓鱼邮件特征：</strong></p>\n<p style=\"text-indent: 2em;\">1、该类钓鱼邮件通常以办公系统（如邮件、OA系统）升级、优化为借口，向用户索取个人信息；</p>\n<p style=\"text-indent: 2em;\">2、该类钓鱼邮件会公然索取用户密码；</p>\n<p style=\"text-indent: 2em;\">3、该类钓鱼邮件提供的支撑邮箱均为外网邮箱（如<a href=\"mailto:sevcvr@foxmail.com\">sevcvr@foxmail.com</a>），非集团企业邮箱（<a href=\"mailto:如67882255@chinaunicom.cn\">如67882255@chinaunicom.cn</a>）。</p>\n<p style=\"text-indent: 2em;\"><strong>我们也在此提醒广大用户：</strong></p>\n<p style=\"text-indent: 2em;\">1、不要在办公终端随意打开来历不明的第三方软件；</p>\n<p style=\"text-indent: 2em;\">2、在陌生环境终端计算机上，不要输入办公系统用户名密码；</p>\n<p style=\"text-indent: 2em;\">3、不随意接入陌生无线网络；</p>\n<p style=\"text-indent: 2em;\">4、收到此类内部邮箱发送的钓鱼邮件，<strong><span style=\"color: #e53333;\">不要回复</span></strong>，可<strong><span style=\"color: #e53333;\">尽快报告</span></strong>属地邮件系统管理员处理；</p>\n<p style=\"text-indent: 2em;\">5、定期修改符合规则的复杂密码（密码有效期：3个月，密码长度：8位以上，密码复杂度等规则）；</p>\n<p style=\"text-indent: 2em;\">6、<span style=\"color: #e53333;\"><strong>维护支撑组不会以任何形式向用户索取密码类敏感信息；</strong></span></p>\n<p style=\"text-indent: 2em;\">7、集团发布业务系统变更的通知邮件，均为统一的服务支持热线&ldquo;联通总部信息系统服务支撑热线&rdquo;&lt;<a href=\"mailto:67882255@chinaunicom.cn\">67882255@chinaunicom.cn</a>&gt;，其他途径均为非正规渠道通知。</p>', '238', 'published');
INSERT INTO `notice` VALUES ('40', '2016-12-08 00:00:00', '纪检组', '集团公司出台《中国联通工作人员涉外合作十条纪律》', '<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">为进一步规范各级领导人员和员工的涉外合作行为，有效防范涉外合作中的廉洁风险，深入推进党风廉洁建设和反腐败工作，日前，集团公司出台《中国联通工作人员涉外合作十条纪律》。具体内容请登录云门户和</span><a href=\"http://www.portal.unicom.local/virtualsite/1436836179082hb4rrHj8xEmjnbC5x8sEvlHjf/call/unisxinxifabu/0/publishsite/infovirtualsite/preview?cid=1482732830731141831\" target=\"_blank\" rel=\"noopener\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">中国联通纪检监察网</span></a><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">浏览。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">请各级领导人员、党员干部和全体员工认真学习涉外合作十条纪律，将纪律和规矩记在心上、落实在行动上，努力营造风清气正的涉外合作氛围。（纪检组监察局）</span></p>', '271', 'published');
INSERT INTO `notice` VALUES ('41', '2017-02-17 00:00:00', '综合部', '规章制度公示', '<p><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">实体渠道部拟发布《中国联通营业厅设备设施现场管理执行标准V1.0版》。根据《中国联通规章制度管理办法》（中国联通集团[2016]532号），现对上述规章制度进行公示并征求意见。请进入OA首页--规章制度清查梳理优化专栏--意见征集，查看制度具体内容并反馈意见。公示期为7个工作日，截止日期为2月24日。</span></p>', '176', 'published');
INSERT INTO `notice` VALUES ('42', '2017-03-15 00:00:00', '综合部', '中国联通职工创新成果评选活动网上平台上线', '<p>为贯彻集团创新战略，进一步激发广大职工的创新潜能和创造活力，动员广大职工围绕公司聚焦战略，立足一线岗位自主学习、岗位创新、岗位成才、岗位奉献，集团公司和集团工会联合开展了&ldquo;聚焦新战略、创新在一线&rdquo;为主题的职工创新成果评选及宣传展示活动。</p>\n<p>在各省、自治区、直辖市分公司，集团总部各部门及直属单位的大力支持下，92项职工创成果已经完成网上评选的前期工作，今天终于上线了。这次网上评选活动将持续一个月时间，登录方式有：云门户首页浮窗评选入口（总部）和云门户首页的牛人部落常用链接进入（或专业应用中搜索&ldquo;牛人部落&rdquo;）。</p>\n<p>欢迎集团公司广大职工积极参与到这次职工创新成果评选活动中来，你们的关注、你们的点赞是职工创新活动的巨大动力。希望集团公司广大职工立足本职岗位，发扬工匠精神，尊重科学、崇尚技能，在集团公司由数量规模型向规模效益型发展模式的转变中，发挥主人翁精神，尽职尽责，勇于担当，在促进公司发展中实现自我价值。</p>\n<p>各级工会组织要积极引导广大职工树立创新发展理念，立足岗位、班组开展技术创新、服务创新和管理创新，不断增强职工创新意识和创新能力，进一步形成基础广泛、人才集聚、成果丰富的群众性创新网络并融入了集团公司的创新体系，夯实集团公司创新型企业建设的群众基础。</p>\n<p style=\"text-align: right;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 集团工会 &nbsp; &nbsp; </p>\n<p style=\"text-align: right;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年3月13日 &nbsp; &nbsp; </p>\n<p>&nbsp;</p>', '127', 'published');
INSERT INTO `notice` VALUES ('43', '2017-04-10 00:00:00', '综合部', '规章制度公示', '<p>集团客户部拟发布《中国联通集团客户服务集成商合作实施管理细则》，根据《中国联通规章制度管理办法》（中国联集团[2016]532号），对上述规章制度进行公示并征求意见，请进入OA首页-规章制度清查梳理优化专栏-公示与意见征集，查看制度具体内容并反馈意见。公示期为5个工作日，截止日期为4月13日。</p>', '159', 'published');
INSERT INTO `notice` VALUES ('44', '2017-05-22 00:00:00', '综合部', '规章制度公示', '<p>集团工会拟发布《中国联合网络通信集团有限公司职工代表大会专门委员会工作制度（试行）》,人力资源部拟发布<strong>《中国联通运维IP专业战略人才队伍管理办法（试行）》</strong>。根据《中国联通规章制度管理办法》（中国联通集团[2016]532号），现对上述规章制度进行公示并征求意见。请进入OA首页--规章制度清查梳理优化专栏--意见征集，查看制度具体内容并反馈意见。公示期为5个工作日，截止日期为5月25日。</p>', '112', 'published');
INSERT INTO `notice` VALUES ('45', '2017-06-30 00:00:00', '工会', '“精神•榜样—中国联通企业文化理念体系发布暨好员工事迹报告会”现场版回看在“沃视频”手机客户端上线', '<p>中国联通企业文化理念体系发布暨好员工事迹报告会的现场版视频在&ldquo;沃视频&rdquo;-&ldquo;热点&rdquo;频道上线，完整版视频将随后上线。欢迎广大员工扫码安装&ldquo;沃视频&rdquo;手机客户端，进入&ldquo;热点&rdquo;频道&ldquo;好员工&rdquo;栏目免流量观看感人事迹。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; <img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" /></p>\n<p style=\"text-align: center;\">扫码安装&ldquo;沃视频&rdquo;</p>', '321', 'published');
INSERT INTO `notice` VALUES ('46', '2017-08-25 00:00:00', '综合部', '《中国联通内部创新孵化工作管理办法》公示', '<p><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">企业发展部拟</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">修订并发布《</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">中国联通内部创新孵化工作管理办法》。根据《中国联通规章制度管理办法》（中国联通集团[2016]532号），现对该规章制度进行公示并征求意见。请进入OA首页--规章制度清查梳理优化专栏--意见征集，查看制度具体内容并反馈意见。公示期为5个工作日。</span></p>', '123', 'published');
INSERT INTO `notice` VALUES ('47', '2017-08-25 00:00:00', '综合部', '中国联通学院“沃分享”直播公开课 2017年第八期授课的通知', '<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">联通学院将于近期举办第八期&ldquo;沃分享&rdquo;直播公开课，邀请山西分公司公司一级讲师霍威老师授课。现将有关事项通知如下。</span></p>\n<p style=\"margin-left: 32.15pt;\"><strong><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">一、授课人</span></strong></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">霍威，山西分公司培训中心专职讲师；集团一级讲师。</span></p>\n<p style=\"text-indent: 32.15pt;\"><strong><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">二、课程名称及主要内容</span></strong></p>\n<p style=\"text-indent: 24pt;\"><span style=\"font-family: 仿宋_GB2312; color: black; font-size: 16pt;\">（一）</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">课程名称：《创新型业务解决方案设计与编写技能》</span></p>\n<p style=\"text-indent: -54pt; margin-left: 78pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">（二）&nbsp; </span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">主要内容</span></p>\n<p style=\"text-indent: 44.8pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">1.</span><a name=\"_GoBack\"></a><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">为什么要关注创新型业务解决方案</span></p>\n<p style=\"text-indent: 44.8pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">2.</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">什么是创新型业务解决方案</span></p>\n<p style=\"text-indent: 44.8pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">3.</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">创新型业务解决方案设计与编写技能</span></p>\n<p style=\"text-indent: 44.8pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">4.</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">创新型业务解决方案呈现技巧</span></p>\n<p style=\"text-indent: 32.15pt;\"><strong><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">三、授课时间及形式</span></strong></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">（一）授课时间：</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">8</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">月29日（周二）下午2：00&mdash;5：00；</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">（二）授课形式： </span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">1. </span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">中国联通网上学院直播平台；</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">2.</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">&ldquo;中国联通微学堂&rdquo;微信平台直播。</span></p>\n<p style=\"text-indent: 31.5pt;\"><strong><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">四、课程适用对象</span></strong></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">包括但不限于政企线客户经理岗、支撑经理岗、项目经理岗人员；市场线产品经理岗等相关人员。 </span></p>\n<p style=\"text-indent: 32.15pt;\"><strong><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">五、报名方式</span></strong></p>\n<p style=\"text-indent: 24pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">（一）总部各部门通过网上学院报名参加。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">请集团各部门相关人员于8月28日（周一）17：00前登录网络学院进行预报名。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">预报名方式：登录云门户，点击&ldquo;应用中心&rdquo;的&ldquo;专业应用&rdquo;，点击&ldquo;网上学院&rdquo;，进入后点击左侧列表中&ldquo;我的班级&rdquo;，在&ldquo;培训班报名&rdquo;<span style=\"color: black;\">中&ldquo;</span>《创新型业务解决方案设计与编写技能》直播公开课&rdquo;点击&ldquo;报名&rdquo;键进行预报名。报名以时间顺序为准进行排序，名额有限，先到先得；报名成功后，将会收到邮件和站内短消息确认通知。</span></p>\n<p style=\"text-indent: 24pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">（二）各省分公司、子公司、地市分公司相关人员通过网上学院直播平台外接投影仪方式进行集中播放和收看。具体外接方式请咨询技术支撑联系人。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">请组织收看的各地市分公司网上学院平台管理员提前与本省分公司网上学院平台管理员联系并添加账户权限，组织集中收看。</span></p>\n<p style=\"text-indent: 31.5pt;\"><strong><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">六、直播收看时间及方式</span></strong></p>\n<p style=\"text-indent: 16pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">（一）收看时间：8月29日（周二）下午2：00-5：00；</span></p>\n<p style=\"text-indent: 16pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">（二）收看方式</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">1.</span><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">网上学院直播平台收看方式：登录云门户，点击&ldquo;应用中心&rdquo;的&ldquo;专业应用&rdquo;，点击&ldquo;网上学院&rdquo;，进入后点击主页顶端主题栏中&ldquo; 直播中心&rdquo;，在&ldquo;直播中心&rdquo;中点击&ldquo;《创新型业务解决方案设计与编写技能》直播公开课&rdquo;进行收看。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">请收看直播的人员提前20分钟登录网上学院&ldquo;直播中心&rdquo;。</span></p>\n<p style=\"text-indent: 24pt; margin-left: 8pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">2.</span><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">微信公众号收看方式：关注<strong>&ldquo;中国联通微学堂&rdquo;</strong>微信公众号，在公众号中回复&ldquo;直播&rdquo;两个字，点击回复语，输入个人云门户OA账号、登录密码即可收看直播。</span></p>\n<p style=\"text-indent: 29.9pt;\"><strong><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">七、联系人</span></strong></p>\n<p style=\"text-indent: 29.75pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">（一）联通学院网上学习运营管理中心技术支撑：</span></p>\n<p style=\"text-indent: 37.9pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">陈幼玲，电话：13031165064， chenyouling@parim.net</span></p>\n<p style=\"text-indent: 30pt;\"><span style=\"line-height: 150%; font-family: 仿宋_GB2312; font-size: 16pt;\">（二）联通学院</span></p>\n<p style=\"text-indent: 40pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">盛锦晖，电话:18601102912,</span><a href=\"mailto:shengjh@chinaunicom.cn\"><span style=\"font-family: 仿宋_GB2312; color: black; font-size: 16pt;\">shengjh@chinaunicom.cn</span></a></p>', '153', 'published');
INSERT INTO `notice` VALUES ('39', '2016-10-06 00:00:00', '纪检组', '中国联通纪检监察网刊发“斩断伸向手机终端的黑手——许济源借担保手机业务大肆侵占被查处”', '<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">10月24日，集团公司党组纪检组在中国联通纪检监察网上刊发&ldquo;中国联通反腐倡廉警示录&rdquo;之七：&ldquo;斩断伸向手机终端的黑手&mdash;&mdash;许济源借担保手机业务大肆侵占被查处&rdquo;。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">本期警示录结合中国联通辽宁省鞍山市分公司原集团客户事业部客户经理许济源与社会人员内外勾结、大肆骗取手机终端和手机卡低价贱卖牟利，给分公司造成重大损失的典型案例，说明各级领导人员尤其是&ldquo;一把手&rdquo;唯有从严从实担当起主体责任，严肃查处侵占手机、光猫等贪腐行为、形成有效震慑，并严之又严地狠抓整改、堵塞一个个管理漏洞，才能真正形成良管良治的企业生态。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">本期中国联通反腐倡廉警示录的具体情况，请登录</span><a href=\"http://www.portal.unicom.local/virtualsite/1436836179082hb4rrHj8xEmjnbC5x8sEvlHjf/call/unisxinxifabu/0/publishsite/infovirtualsite/preview?cid=1477273942808987063\" target=\"_blank\" rel=\"noopener\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">中国联通纪检监察网</span></a><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">浏览。（纪检组监察局）</span></p>', '186', 'published');
INSERT INTO `notice` VALUES ('48', '2017-09-22 00:00:00', '综合部', '《中国联通委托审计管理办法》公示', '<p>审计部拟修订《中国联通委托审计管理办法》。根据《中国联通规章制度管理办法》（中国联通集团[2016]532号），现对该规章制度进行公示并征求意见。请进入OA首页-规章制度清查梳理优化专栏&mdash;意见征集，查看制度具体内容并反馈意见。公示期为5个工作日。</p>', '85', 'published');
INSERT INTO `notice` VALUES ('51', '2017-11-23 00:00:00', '信息化部', '关于内网僵尸应用清理下线的公告', '<p>为落实公司&ldquo;瘦身健体、提质增效&rdquo;的目标，由综合部牵头、信息化部配合，对云门户应用中心内集团应用、总部应用的使用情况进行了逐一分析。通过梳理后计划采用 &ldquo;关停并转&rdquo;的方式下线一批僵尸应用（主要为应用使用率过低、应用数据长时间无更新的老旧应用），下线应用清单见附件。&nbsp;</p>\n<p>如有部门用户仍在使用附件清单中应用，请在公告期内（截止2017年11月30日）联系综合部和信息化部申请不下线该应用。公告期结束后，信息化部将统一关闭下线应用的云门户入口。&nbsp;</p>\n<p>&nbsp; 在关闭下线应用云门户入口之后，计划在2018年5月30日做应用彻底下线（应用停服）。如有部门用户需对下线应用内部数据做保留的，请在2018年5月30日之前联系综合部和信息化部申请做数据保留。未申请做数据保留的下线应用数据将随应用彻底下线做数据删除（数据不可恢复）。&nbsp;</p>\n<p style=\"text-align: right;\"><br /><br />综合部联系人：谷冀，66259330，guji1@chinaunicom.cn &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <br />信息化部联系人：常沛，18601105061，changp3@chinaunicom.cn</p>', '321', 'published');
INSERT INTO `notice` VALUES ('49', '2017-11-16 00:00:00', '纪检组', '关于公布集团公司光改专项检查工作举报方式的公告', '<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">根据集团公司党组要求和2017年公司党风廉政建设和反腐败工作会议部署，集团公司党组纪检组在全系统组织开展了光改专项检查工作。为切实做好此次专项检查，充分发挥群众监督作用，欢迎广大干部员工举报反映在光改工程建设、光改退铜及处置、固网终端管理等方面存在违规违纪问题的人和事，举报重点内容包括：</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">1.在光改工程建设过程中，通过虚列项目、虚增项目建设规模和投资规模、虚报冒领和套取变卖光纤等工程材料方式谋取私利，虚报、冒领、套取工程赔补费及其他费用等违纪违规问题。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">2.在光改退铜及处置过程中，该退不退、退而不交、监守自盗、低价处置、侵占退铜收入等违规违纪问题。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">3.在光猫（ONU）、IPTV机顶盒（含OTT）、家庭网关等固网终端管理过程中，存在的终端流失、套取变卖谋取私利等违规违纪问题。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">集团公司党组纪检组、监察局的举报方式如下：</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">电话：010-88091674；</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">短信：18600580152；</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">电子邮箱：jijianjiancha@chinaunicom.cn；</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">寄信地址：北京市西城区金融大街21号中国联通集团公司纪检组监察局，邮编：100033。</span></p>', '123', 'published');
INSERT INTO `notice` VALUES ('50', '2017-11-17 00:00:00', '综合部', '《中国联通运维专业战略人才队伍管理办法（试行）》公示', '<p><span style=\"font-size: 15pt; font-family: 仿宋_GB2312;\">人力资源部拟发布《</span><span style=\"font-size: 15pt; font-family: 仿宋_GB2312;\">中国联通运维专业战略人才队伍管理办法（试行）</span><span style=\"font-size: 15pt; font-family: 仿宋_GB2312;\">》。根据《中国联通规章制度管理办法》（中国联通集团[2016]532号），现对该规章制度进行公示并征求意见。请进入OA首页--规章制度清查梳理优化专栏--公示与意见征集，查看制度具体内容并反馈意见。公示期为</span><span style=\"font-size: 15pt; font-family: 仿宋_GB2312;\">5</span><span style=\"font-size: 15pt; font-family: 仿宋_GB2312;\">个工作日。</span></p>', '297', 'published');
INSERT INTO `notice` VALUES ('52', '2017-11-27 00:00:00', '综合部', '《中国联通发展战略与规划管理办法（试行）》公示', '<p><span style=\"font-size: 16pt; font-family: 仿宋_GB2312;\">企业发展部拟发布《中国联通发展战略与规划管理办法（试行）》。根据《中国联通规章制度管理办法》（中国联通集团[2016]532号），现对该规章制度进行公示并征求意见。请进入OA首页--规章制度清查梳理优化专栏--公示与意见征集，查看制度具体内容并反馈意见。公示期为5个工作日。</span></p>', '22', 'published');
INSERT INTO `notice` VALUES ('53', '2017-12-04 00:00:00', '信息化部', '关于云门户系统短信平台停机维护的通知', '<p style=\"text-align: left;\"><span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">为提高云门户系统短信平台发送性能，信息化部（信息安全部）计划在2017年12月8日（周五）凌晨00：00至2017年12月8日6：00点对短信平台进行停机维护，届时云门户短信发送功能无法使用。影响范围为通过云门户发送短信的用户以及使用云门户系统短信平台发送短信的所有系统。</span><br /> <span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">&nbsp;&nbsp;&nbsp; </span><span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">如有问题，请与IT服务支撑热线（67882255）联系。感谢您的理解和支持！</span><br /> <span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">&nbsp;</span><br /> <span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">实施期间联系人：</span><br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">信息化部（信息安全部），常沛，18601105061，</span><a href=\"mailto:changp3@chinaunicom.cn\"><span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">changp3@chinaunicom.cn</span></a><br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">联通系统集成公司，文志鹏，18674893160，</span><a href=\"mailto:jc-wenzp@chinaunicom.cn\"><span style=\"font-size: 16pt; font-family: FangSong_GB2312; line-height: 1.5;\">jc-wenzp@chinaunicom.cn</span></a></p>', '88', 'published');
INSERT INTO `notice` VALUES ('54', '2018-01-08 00:00:00', '纪检组', '中国联通纪检监察网刊发2017年巡视整改情况通报', '<p align=\"center\"><strong><span style=\"line-height: 1.5; font-family: Microsoft YaHei; font-size: 24pt;\">中国联通纪检监察网刊发2017年党组巡视</span></strong></p>\n<p align=\"center\"><strong><span style=\"line-height: 1.5; font-family: Microsoft YaHei; font-size: 24pt;\">子公司、直属单位整改情况通报</span></strong></p>\n<p align=\"center\">&nbsp;</p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">根据集团公司2017年党组巡视工作统一部署，党组巡视组对中讯邮电咨询设计院有限公司（含联通网络技术研究院、联通通信建设有限公司）、联通华盛通信有限公司（含联通兴业通信技术有限公司）、联通时科（北京）信息技术有限公司、联通在线信息科技有限公司、联通系统集成有限公司（含中网威信电子安全服务有限公司）、联通信息导航有限公司、联通支付有限公司、联通研究院、京都信苑饭店、云数据有限公司、联通创新创业投资有限公司、联通软件研究院、联通智网科技有限公司、联通集团财务有限公司、联通学院、小沃科技有限公司进行了巡视。按照党务公开原则和《中国共产党巡视工作条例》有关要求，2018年1月17日起,集团公司党组纪检组将分期通报子公司、直属单位巡视整改工作主要情况，接受党员、干部和员工监督。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">各子公司、直属单位关于巡视整改情况的通报，请登录</span><a href=\"http://www.portal.unicom.local/virtualsite/1436836179082hb4rrHj8xEmjnbC5x8sEvlHjf\" target=\"_blank\" rel=\"noopener\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">中国联通纪检监察网</span></a><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">&ldquo;巡视巡察&rdquo;栏目浏览。（</span><span style=\"line-height: 2; font-family: KaiTi_GB2312; font-size: 16pt;\">纪检组监察局</span><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">）</span></p>', '168', 'published');
INSERT INTO `notice` VALUES ('55', '2018-02-02 00:00:00', '综合部', '关于组织收看中国联通学院“沃分享”直播公开课 2018年第二期授课的通知', '<p>&nbsp;联通学院将于近期以&ldquo;《支付/金融业务助力中国联通互联网化转型》&rdquo;为主题，邀请联通支付有限公司孔繁华总经理进行专题讲座。现将有关事项通知如下：</p>\n<p><strong>一、授课人</strong></p>\n<p>&nbsp;孔繁华&nbsp; &nbsp;&nbsp;联通支付有限公司执行董事、总经理</p>\n<p><strong>二、课程名称及主要内容</strong></p>\n<p>（一）课程名称</p>\n<p>《支付/金融业务助力中国联通互联网化转型》</p>\n<p>（二）主要内容</p>\n<p>&nbsp;1.为什么大力发展支付/金融业务;</p>\n<p>&nbsp;2.联通支付公司基本情况;</p>\n<p>&nbsp;3.沃支付的能力和产品/业务;</p>\n<p>&nbsp;4.协同服务主业的场景和案例;</p>\n<p>&nbsp;5.员工服务实践;</p>\n<p>&nbsp; &nbsp; &nbsp;6.期望与建议。</p>\n<p><strong>三、讲座时间及形式</strong></p>\n<p>（一）讲座时间、地点：</p>\n<p>讲座时间：2月 9日下午2：00&mdash;5：00</p>\n<p>（二）讲座形式</p>\n<p>1.联通大厦B310报告厅面授；</p>\n<p>2.中国联通网上学院平台直播；</p>\n<p>3.中国联通微学堂微信平台直播。</p>\n<p><strong>四、课程适用对象</strong></p>\n<p>公司全体人员。</p>\n<p><strong>五、参加方式 </strong></p>\n<p>（一）集团总部及在京子公司人员在中国联通大厦B310报告厅参加。</p>\n<p>（二）各省分公司、地市分公司相关人员通过网上学院直播平台外接投影仪方式进行集中播放和收看。具体外接方式请咨询技术支撑联系人。</p>\n<p>请组织收看的各地市分公司网上学院平台管理员提前与本省分公司网上学院平台管理员联系并添加账户权限，组织集中收看。</p>\n<p><strong>六、直播收看方式 </strong></p>\n<p><strong>(一)网上学院直播平台收看方式</strong></p>\n<p>登录云门户，点击&ldquo;应用中心&rdquo;的&ldquo;专业应用&rdquo;，点击&ldquo;网上学院&rdquo;，进入后点击主页顶端主题栏中&ldquo; 直播中心&rdquo;，在&ldquo;直播中心&rdquo;中点击&ldquo;《支付/金融业务助力中国联通互联网化转型》直播公开课&rdquo;进行收看。</p>\n<p>请收看直播的人员提前20分钟登陆网上学院&ldquo;直播中心&rdquo;。</p>\n<p><strong>（二）微信公众号收看方式</strong></p>\n<p>关注&ldquo;中国联通微学堂&rdquo;微信公众号，在公众号中回复&ldquo;直播&rdquo;两个字，点击回复语，输入个人云门户OA账号、登录密码即可收看直播。</p>\n<p><strong>七、培训联系人</strong></p>\n<p>（一）联通学院网上学习运营管理中心技术支撑</p>\n<p>陈幼玲， 13031165064 ,<a href=\"mailto:chenyouling@parim.net\"><u>chenyouling@parim.net</u></a></p>\n<p>（二）联通学院</p>\n<p>盛锦晖，18601102912，shengjh@chinaunicom.cn</p>\n<p>&nbsp;</p>', '169', 'published');
INSERT INTO `notice` VALUES ('57', '2018-03-13 00:00:00', '工会', '请为心目中的“信息通信行业工匠”投票', '<p>由中国通信企业协会与中国国防邮电工会共同主办、人民邮电报社承办的&ldquo;信息通信行业工匠&rdquo;评选22进10投票活动近期启动。经过前期激烈评比，中国联通共有三名员工入围22进10候选人名单，他们分别是：北京分公司曲晓松、辽宁分公司陈雷、中讯邮电设计院夏俊杰。集团工会号召全体联通人向入选的联通工匠学习，并为他们投上宝贵一票。投票方式：&nbsp;</p>\n<p><strong>1.微信投票：</strong>&nbsp;</p>\n<p>扫描下方二维码，关注&ldquo;人民邮电报&rdquo;微信公众号；在首页点击投票链接，链接后在最下方选择候选人进行投票（联通入选候选人为：<strong>4号曲晓松，13号陈雷、22号夏俊杰</strong>）。&nbsp;</p>\n<p><strong>2.微博投票：</strong>&nbsp;</p>\n<p>关注&ldquo;人民邮电报&rdquo;官方微博，打开置顶微博链接进行投票。&nbsp;</p>\n<p><strong>&nbsp;3.投票截止时间：</strong><strong><br /></strong>&nbsp;2018年3月15日24时。&nbsp;</p>\n<p>&nbsp;</p>', '158', 'published');
INSERT INTO `notice` VALUES ('58', '2018-03-13 00:00:00', '综合部', '中央电视台将播出联通混改专题采访', '<p style=\"text-indent: 2em;\">3月13日20:30，CCTV-2财经频道《经济信息联播》将播出关于联通混改的专题采访节目，届时欢迎广大员工收看。</p>\n<p style=\"text-indent: 2em;\">&ldquo;混改是国企改革的重要突破口。去年8月，中国联通揭开混改面纱，打响了央企集团层面整体混改的第一枪，具有开创性的标杆意义。&rdquo;本次专题采访，将公开展现联通混改后的新风貌、新变化。</p>', '189', 'published');
INSERT INTO `notice` VALUES ('59', '2018-05-10 00:00:00', '信息化部', '关于老旧应用系统因安全漏洞无法修复停服的公告', '<p>在公司安全管理部门对信息系统安全扫描中，发现应用&ldquo;财务信息专栏&rdquo;和&ldquo;企业发展管理平台&rdquo;存在一些高危安全漏洞。因系统建设时间比较久远，系统建设时使用的技术框架、业务实现机制已经不能满足现有安全管理规范。基于现有代码版本进行系统安全漏洞修复难度大，风险不可控且成本投入较高。</p>\n<p>为了防止安全漏洞被利用，计划对&ldquo;财务信息专栏&rdquo;和&ldquo;企业发展管理平台&rdquo;进行停服操作。请两个应用系统的业务管理部门或部门使用者于2018年5月18日之前联系信息化部，协商系统业务迁移及数据备份工作。如到期未联系，将对应用先做停服操作，停服后系统不可用。</p>\n<p>&nbsp;</p>\n<p>附：应用系统简介</p>\n<p>一、财务信息专栏</p>\n<p>&ldquo;财务信息专栏&rdquo;是本着便于中国联通财务相关人员的工作交流及资料、信息的共享的目的，在2011年进行建设并开通，集团总部、省分、地市及子公司分配权限人员均可通过门户系统访问该模块。</p>\n<p>二、企业发展管理平台</p>\n<p>&ldquo;企业发展管理平台&rdquo;是一个集信息发布、工作信息上报、信息评审、信息批量管理、交流反馈的内容功能为一体的系统，通过信息共享和交流，支撑企发部信息化工作的开展。</p>\n<p>&nbsp;&nbsp;&nbsp;</p>\n<p style=\"text-align: left;\">信息化部联系人：常沛，18601105061，<u></u><u><a target=\"_blank\">changp3@chinaunicom.cn</a></u></p>\n<p>&nbsp;</p>', '53', 'published');
INSERT INTO `notice` VALUES ('60', '2018-05-21 00:00:00', '综合部', '中华人民共和国审计署专项审计调查通知书', '<p><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">中国联合网络通信集团有限公司：</span></p>\n<p><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">&nbsp;&nbsp;&nbsp;根据《中华人民共和国审计法》第二十七条的规定，我署决定派出专项审计调查组，自2018年5月上旬起，对你公司2017年度资产负债损益和境外投资及境外国有资产管理使用情况进行专项审计调查，必要时将追溯到相关年度和延伸调查有关单位。请予以配合，并提供有关资料（包括电子数据资料）和必要的工作条件。</span></p>\n<p style=\"text-indent: 31pt;\">&nbsp;&nbsp;<span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">专项审计调查组由洪承旭任组长，嵇永如、邬彦如、张全廉任副组长，成员包括王志宏、刘志波、邓婉宁、刘忠锋、顾平等。</span></p>\n<p style=\"text-indent: 31pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">附件：审计&ldquo;八不准&rdquo;工作纪律</span></p>\n<p>&nbsp;</p>\n<p style=\"text-align: right;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">审计署&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: right;\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2018</span><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">年5月7日&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>', '122', 'published');
INSERT INTO `notice` VALUES ('61', '2018-05-24 00:00:00', '纪检组', '关于组织学习中国联通纪检监察网组局观点文章的通知', '<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">5月23日,中国联通纪检监察网刊发了&ldquo;组局观点&rdquo;文章《光改检查：问责不力，就是有错不纠、纵容犯错》。文章针对各单位正在进行的光改专项检查处理问责工作中出现的各种不正确认识进行了辨析，指出了以打折扣、搞变通、有选择的方式落实集团公司统一制定的处理问责政策的危害性，对下一步依规依纪抓好处理问责工作提出了明确要求。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">详细内容，请登录</span><a href=\"http://www.portal.unicom.local/virtualsite/1436836179082hb4rrHj8xEmjnbC5x8sEvlHjf\" target=\"_blank\" rel=\"noopener\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">中国联通纪检监察网</span></a><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">浏览。</span></p>\n<p style=\"text-indent: 2em;\">&nbsp;</p>\n<p style=\"text-indent: 2em; text-align: right;\" align=\"right\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">集团公司纪检组监察局&nbsp;&nbsp;&nbsp; </span>&nbsp;</p>\n<p style=\"text-indent: 2em; text-align: right;\" align=\"right\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">2018年5月24日&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br /></span></p>', '232', 'published');
INSERT INTO `notice` VALUES ('56', '2018-03-02 00:00:00', '纪检组', '关于集团公司首批供应商黑名单的公告', '<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">根据《中国联通供应商黑名单管理办法（试行）》的规定，经集团公司总经理办公会议审议通过，现将在全集团范围内禁入的首批供应商黑名单予以公布（具体见附件）,禁入起止时间自2018年2月28日起计算。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">请各级采购/需求部门在后续组织招标采购或业务合作引入过程中强化资格审核，在禁入期内应严禁列入黑名单的供应商参与投标或开展新的业务合作。如拒不执行，将按照《中国联通供应商黑名单管理办法（试行）》的要求，严肃追究相关人员的责任。同时，实行供应商黑名单管理是依据公司内部规定对实施了不当行为的供应商所采取的处罚措施，请各单位在名单发布、宣传及使用过程中注意把握分寸，以防止引起不必要的法律纠纷。</span></p>\n<p style=\"text-indent: 2em;\">&nbsp;</p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">附件：</span><a href=\"http://www.portal.unicom.local/fileshare/1354949747988cgoy3Iep3Isc1OkfyyEiwJ2Md/download?fid=54340\" target=\"_blank\" rel=\"noopener\"><span style=\"line-height: 2; font-family: NSimSun; font-size: 16pt;\">集团公司首批供应商黑名单</span></a></p>\n<p style=\"text-indent: 2em;\">&nbsp;</p>\n<p style=\"text-indent: 2em;\">&nbsp;</p>\n<p style=\"text-indent: 2em;\" align=\"right\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">中国联合网络通信集团有限公司&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p style=\"text-indent: 2em;\" align=\"right\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">2018年3月1日&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>', '232', 'draft');
INSERT INTO `notice` VALUES ('62', '2018-06-04 00:00:00', '办公厅', '“沃创客”二期项目毕业路演6月6日精彩呈现！', '<p style=\"text-indent: 21.0pt;\">2018年6月6日，中国联通内部创新孵化计划（&ldquo;沃创客&rdquo;）二期将于在北京中关村朔黄发展大厦举行毕业路演。从249个申报项目中脱颖而出的19个项目，经过半年磨砺，创业团队从产品研发、市场探索到融资对接一路披荆斩棘，部分项目在出孵之前，就已经签署了外部融资意向书，估值最高达5000万人民币；部分项目成果已经获得内部分子公司的认可，开展试点应用。</p>\n<p style=\"text-indent: 21.0pt;\">他们能否交上一份满意的答卷，等待您的见证。</p>\n<p style=\"text-indent: 21.0pt;\">活动时间：2018年6月6日</p>\n<p style=\"text-indent: 21.0pt;\">活动地点：北京市海淀区中关村朔黄发展大厦5层</p>\n<p style=\"text-indent: 21.0pt;\">活动议程：</p>\n<p style=\"text-indent: 21.0pt;\">13:00-13:30&nbsp;&nbsp;&nbsp;&nbsp; 签到</p>\n<p style=\"text-indent: 21.0pt;\">13:30-13:40&nbsp;&nbsp;&nbsp;&nbsp; 嘉宾致辞</p>\n<p style=\"text-indent: 21.0pt;\">13:40-13:45&nbsp;&nbsp;&nbsp;&nbsp; 一期学员分享</p>\n<p style=\"text-indent: 21.0pt;\">13:45-16:55&nbsp;&nbsp;&nbsp;&nbsp; 二期项目路演</p>\n<p style=\"text-indent: 21.0pt;\">16:55-17:30&nbsp;&nbsp;&nbsp;&nbsp; 自由交流</p>\n<p style=\"text-indent: 21.0pt;\">&nbsp;</p>\n<p style=\"text-indent: 21.0pt;\">为了便于全体联通员工了解，本次毕业路演会除可现场参与外，还可通过直播和回看方式收看：</p>\n<p style=\"text-indent: 21.0pt;\">&nbsp;</p>\n<p><strong>一、直播方式：</strong></p>\n<p><strong>1．网上学院直播</strong></p>\n<p style=\"text-indent: 21.0pt;\">在路演会当天，已报名观看直播的联通员工可登录云门户，点击&ldquo;应用中心&rdquo;的&ldquo;专业应用&rdquo;，点击&ldquo;网上学院&rdquo;，进入后点击主页顶端主题栏中&ldquo; 直播中心&rdquo;，在&ldquo;直播中心&rdquo;中点击&ldquo;<span style=\"color: red;\">沃创客二期毕业路演</span>&rdquo;进行收看。</p>\n<p style=\"text-indent: 21.0pt;\">请收看直播的人员提前20分钟登陆网上学院&ldquo;直播中心&rdquo;。</p>\n<p style=\"text-indent: 21.0pt;\">&nbsp;</p>\n<p><strong>2. &ldquo;中国联通微学堂&rdquo;公众号直播</strong></p>\n<p style=\"text-indent: 21.0pt;\">在路演会当天，关注&ldquo;中国联通微学堂&rdquo;微信公众号，在公众号中点击左下角&ldquo;直播课堂&rdquo;按钮后输入个人云门户OA账号、登录密码即可收看直播。</p>\n<p style=\"margin-left: 31.5pt; text-indent: -21.0pt;\"><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" width=\"300\" height=\"300\" /><br />&ldquo;中国联通微学堂&rdquo;二维码</p>\n<p style=\"text-indent: 21.0pt;\">&nbsp;</p>\n<p><strong>二、回看方式：</strong></p>\n<p style=\"text-indent: 21.0pt;\">&nbsp;&nbsp;&nbsp; 登录联通云门户，点击&ldquo;应用中心&rdquo;的&ldquo;专业应用&rdquo;，点击&ldquo;网上学院&rdquo;，进入联通学院首页后点击&ldquo;直播回顾&rdquo;进行收看。</p>\n<p style=\"text-indent: 21.0pt;\">&nbsp;</p>\n<p style=\"text-indent: 21.0pt;\">&nbsp;&ldquo;沃创客&rdquo;二期毕业路演，精彩不容错过！</p>\n<p>&nbsp;</p>\n<p><strong>报名地址：</strong></p>\n<p>http://u7203048.viewer.maka.im/k/Z3S6L6EN</p>', '131', 'published');
INSERT INTO `notice` VALUES ('63', '2018-07-19 00:00:00', '办公厅', '沃创客三期孵化项目招募开始：改变世界，你也可以！', '<p style=\"text-indent: 28.0pt;\"><span style=\"font-size: 14.0pt;\">为落实中央双创精神和公司聚焦创新合作战略，建立健全联通创新体系，集团于2016年5月启动了内部创新孵化计划&ldquo;沃创客&rdquo;。目前&ldquo;沃创客&rdquo;已完成了两期孵化，共有665个项目参与报名，56个项目通过评审，经过六个月的孵化后，最终34个项目出孵成立了公司，团队首轮融资最高达到1500万。参与&ldquo;沃创客&rdquo;的员工在产品创新、市场拓展、团队建设等方面均取得了较大的提升。</span></p>\n<p style=\"text-indent: 28.0pt;\"><span style=\"font-size: 14.0pt;\">依据集团下发的&ldquo;关于修订《中国联通内部创新孵化工作管理办法》的通知（中国联通集团[2017]307号）&rdquo;。现正式启动内部创新孵化第三期项目及团队的征集工作，即日起即可登陆&ldquo;沃创客&rdquo;官方平台（http://10.0.48.2:3143/）进行申报。三期招募具体要求如下：</span></p>\n<p style=\"margin-left: 42.0pt; text-indent: -21.0pt;\"><span style=\"font-size: 14.0pt;\">一、</span><span style=\"font-size: 14.0pt;\">招募范围</span></p>\n<p style=\"margin-left: 21.0pt;\"><span style=\"font-size: 14.0pt;\">面向各单位有志于创新创业的合同制在岗员工和团队进行项目征集。</span></p>\n<p style=\"margin-left: 42.0pt; text-indent: -21.0pt;\"><span style=\"font-size: 14.0pt;\">二、</span><span style=\"font-size: 14.0pt;\">招募领域</span></p>\n<p style=\"text-indent: 21.0pt;\"><span style=\"font-size: 14.0pt;\">创新项目方向应聚焦在大数据、物联网、云计算与IT技术、人工智能、网络及信息安全、网络技术（ 5G、SDN等）、智能硬件、电源与节能、音视频技术与应用、区块链、互联网应用、基础科学与应用等创新领域。同时，鼓励申报解决公司发展、效益、效率、服务、管理和建维等方面问题的项目。申报项目要求与公司已自主研发、经营的产品不相重复。</span></p>\n<p style=\"margin-left: 42.0pt; text-indent: -21.0pt;\"><span style=\"font-size: 14.0pt;\">三、</span><span style=\"font-size: 14.0pt;\">时间安排</span></p>\n<p style=\"text-indent: 21.0pt;\"><span style=\"font-size: 14.0pt;\">2018</span><span style=\"font-size: 14.0pt;\">年8月19日为项目申报截止时间，请创新团队在此时间点前登陆内部创新孵化&ldquo;沃创客&rdquo;平台官网（http://10.0.48.2:3143/）自行完成项目申报；</span></p>\n<p style=\"text-indent: 21.0pt;\"><span style=\"font-size: 14.0pt;\">8</span><span style=\"font-size: 14.0pt;\">月底前运营单位将完成项目形式审查和初审；</span></p>\n<p style=\"text-indent: 21.0pt;\"><span style=\"font-size: 14.0pt;\">9</span><span style=\"font-size: 14.0pt;\">月底前完成项目复审和公示，下发本批入孵项目及团队名单，组织签署入孵协议及培训等；</span></p>\n<p style=\"text-indent: 21.0pt;\"><span style=\"font-size: 14.0pt;\">所有项目评审通知和进展都将在沃创客网站上公布，请参与团队随时关注。</span></p>\n<p style=\"text-indent: 28.0pt;\"><span style=\"font-size: 14.0pt;\">期待有创业梦想的小伙伴们加我们，让&ldquo;沃&rdquo;助你成就创业梦想，和&ldquo;沃&rdquo;一起用创新改变世界。（联通创投、联通研究院）</span></p>', '197', 'published');
INSERT INTO `notice` VALUES ('64', '2018-09-21 00:00:00', '办公厅', '中国联通2018年法律专业线项目获奖公示', '<p style=\"text-align: left; text-indent: 32pt;\" align=\"left\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">根据《关于中国联通人才管理体系及战略人才队伍建设的指导意见》（中国联通集团[2016]128号）、《关于印发〈中国联通法律专业战略人才队伍管理办法（试行）〉的通知》（中国联通集团[2017]378号）和《法律专业线项目管理暂行办法》（企发／法律[2018]71号），集团公司法律专业战略人才管理工作组组建了评审委员会，于2018年8月28日对2017-2018年度第一批申请结项的法律专业线项目进行了评审。根据评审结果，经集团公司法律专业战略人才管理工作组开会研究，评出2017-2018年度法律专业线项目一等奖1项、二等奖2项、三等奖3项、优秀奖4项。获奖名单见附件。 </span></p>\n<p style=\"text-align: left; text-indent: 32pt;\" align=\"left\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">现将获奖项目名单予以公示，公示时间为2018年9月30日至10月11日。公示期间，如有异议，请于10月11日17:00前反馈至集团公司企业发展部/法律部。</span></p>\n<p style=\"text-align: left; text-indent: 32pt;\" align=\"left\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">联系人：</span></p>\n<p style=\"text-align: left; text-indent: 32pt;\" align=\"left\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">王子兰，18601108699，</span><a href=\"mailto:wangzilan@chinaunicom.cn\"><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">wangzilan@chinaunicom.cn</span></a><span style=\"font-family: 仿宋_GB2312; font-size: 16pt;\">。</span></p>', '125', 'published');
INSERT INTO `notice` VALUES ('65', '2018-10-25 00:00:00', '办公厅', '关于开展宪法有奖答题活动的通知', '<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">2018</span><span style=\"font-family: 仿宋; font-size: 16pt;\">年3月11日，第十三届全国人大一次会议通过并颁布实施了宪法修正案。为在全集团范围内深入开展尊崇宪法、学习宪法、遵守宪法、维护宪法、运用宪法的宣传教育活动，大力弘扬宪法精神，大力弘扬社会主义法治精神，根据中国联通&ldquo;七五&rdquo;普法规划和《关于学习宣传和贯彻实施宪法工作安排的通知》（中国联通集团【2018】116号），集团公司&ldquo;七五&rdquo;普法工作领导小组办公室将组织开展宪法知识答题活动，有关安排如下：</span></p>\n<p><strong><span style=\"font-family: 仿宋; font-size: 16pt;\">&nbsp;&nbsp;&nbsp; </span></strong><strong><span style=\"font-family: 仿宋; font-size: 16pt;\">一、活动时间及形式</span></strong></p>\n<p style=\"text-indent: 40pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">（一）2018年10月29日至12月31日期间，在全集团开展每周宪法知识有奖答题活动。</span></p>\n<p style=\"text-indent: 40pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">（二）12.4国家宪法日期间组织宪法知识答题。题目将从宪法知识有奖答题活动的题目库中选取，不提供答案。</span></p>\n<p style=\"text-indent: 32.15pt;\"><strong><span style=\"font-family: 仿宋; font-size: 16pt;\">二、参加范围</span></strong></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">集团各级公司全体人员。</span></p>\n<p style=\"text-indent: 32.15pt;\"><strong><span style=\"font-family: 仿宋; font-size: 16pt;\">三、有奖答题活动规则</span></strong></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">（一）每周一更新5道题，每周一至周五为一个答题周期。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">（二）每人每周可参与4次答题，以数次答题中最高得分计算成绩（每期最高分数为5分），总成绩为每期成绩之和（总成绩最高分为50分）。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">（三）奖励方式</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">有奖活动奖励方案分别由集团总部、各分公司、子公司自行制定并组织实施，集团总部可提供技术支持。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">（四）集团总部奖励方式</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">1.</span><span style=\"font-family: 仿宋; font-size: 16pt;\">根据答题总成绩，于2018年12月15日前确定获奖名单100人，即：</span></p>\n<p style=\"text-indent: 36.95pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">如果答题总成绩为满分的人员超过100人，系统在满分人员范围内进行自动抽奖，确定100人获奖名单；如果总成绩为满分的人员不足100人，则满分人员全部进入获奖名单，不足部分按照总成绩由高到低补足。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">2.</span><span style=\"font-family: 仿宋; font-size: 16pt;\">获奖人员每人可获得100元通信费充值码奖励。系统抽奖后自动将通信费充值码发送短信至获奖人在云门户登记的手机号码上和办公邮件中。</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">(</span><span style=\"font-family: 仿宋; font-size: 16pt;\">五)有奖答题路径</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">1.2018</span><span style=\"font-family: 仿宋; font-size: 16pt;\">年10月23日起：</span></p>\n<p style=\"text-indent: 0cm; margin-left: 68pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">云门户-&gt;企业文化专区-&gt;宪法有奖答题活动</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">2.2018</span><span style=\"font-family: 仿宋; font-size: 16pt;\">年10月24日起：</span></p>\n<p style=\"text-indent: 0cm; margin-left: 67.2pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">随沃行客户端-随沃普法-宪法有奖答题活动</span></p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">上述两个路径均可参加有奖答题活动，两个路径参加答题的次数和成绩合并计算。</span></p>\n<p style=\"text-indent: 32.25pt;\">&nbsp;</p>\n<p style=\"text-indent: 32pt;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">欢迎大家踊跃参加宪法知识有奖答题活动，并预祝大家取得好成绩。</span></p>\n<p style=\"text-indent: 32pt; text-align: left;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">联系人：集团企发部/法律部邢君，010-66259599。</span></p>\n<p style=\"text-indent: 32pt; text-align: left;\"><span style=\"font-family: 仿宋; font-size: 16pt;\">技术支持：张工18518505890。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>', '158', 'published');
INSERT INTO `notice` VALUES ('66', '2018-11-01 00:00:00', '人力资源部', '关于中国联通5G创新中心计划组负责人的招聘启事', '<p>中国联通5G创新中心是集团公司5G创新合作研究、应用产品孵化的主体，主要负责5G行业应用需求分析、行业应用创新研究、定制化解决方案、行业应用产品预研及孵化，以及向各省级分公司、总部相关部门、有关子公司提供技术支撑等，着力提升自主创新能力，助力政企客户市场实现从了解需求、完成产品到获取客户一体化运营，开拓集团公司收入增长新空间，形成发展新动能。</p>\n<p>&nbsp;&nbsp;&nbsp;中国联通5G创新中心实行区隔管理，设立人才特区。人才特区内打破现有联通的职级体系，实行基于能力的角色管理和能力认证；建立以项目制为基础的管理机制，实行项目绩效考核；在人员分类的基础上，以绩效市场化对标为前提合理确定薪酬组合和薪酬标准；实行依据能力认证结果和绩效结果的晋升和下降，每年保持一定的退出率。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;根据工作需要，中国联通5G创新中心同时面向系统内外公开招聘计划组负责人，现就有关事项公告如下：</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>一、招聘岗位</strong></p>\n<p>&nbsp; &nbsp; &nbsp;计划组负责人 ，1人，北京</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>二、报名条件</strong></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1、遵守国家的政策、法规，无违法违纪行为。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp; 2、国家计划内统招全日制本科及以上学历且取得学位，年龄一般不超过40周岁，日期计算截至2018年10月30日。近三年绩效考核等级均为&ldquo;称职&rdquo;及以上。符合以下条件之一的，年龄条件可适当放宽。</p>\n<p>&nbsp;&nbsp; （1）战略人才（骨干人才及以上级别）；</p>\n<p>&nbsp;&nbsp; （2）对项目管理运作精通的业务骨干；</p>\n<p>&nbsp;&nbsp; （3）获得省部级或集团公司级奖励或集团公司级及以上荣誉称号；</p>\n<p>&nbsp;&nbsp; （4）近3年绩效考核等级均为&ldquo;称职&rdquo;及以上且至少有2个&ldquo;优秀&rdquo;，或近5年绩效考核等级均为&ldquo;称职&rdquo;且至少有3个&ldquo;优秀&rdquo;。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp; 除上述基本条件外，应聘人员还应符合应聘岗位具体资格要求，详见附件。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;<strong>三、招聘程序</strong></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp; 招聘工作按照信息发布、个人报名、简历筛选、资格审查、招聘测试、择优入围、延伸调查等程序进行。应聘人员经资格审查、筛选后，进入招聘测试程序，具体测试时间、地点另行通知，届时请保持手机畅通。</p>\n<p>&nbsp;&nbsp;&nbsp;应聘者入选战略人才的，请填写在报名表&ldquo;其他需要说明的情况&rdquo;处，请明确填写入选何专业、何等级战略人才。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;<strong>四、报名办法</strong></p>\n<p>&nbsp;&nbsp;&nbsp; 1.报名时间：2018年10月30日-2018年11月7日</p>\n<p>&nbsp;&nbsp;&nbsp; 2.报名方式：填写附件应聘表，并以&ldquo;应聘岗位-现单位-姓名&rdquo;命名的方式将简历发送至<a href=\"mailto:chinaunicom_5G@163.com\"><u>chinaunicom_5G@163.com</u></a>。</p>\n<p>&nbsp;&nbsp;&nbsp; 3.报名咨询电话：010-68799999-6656</p>\n<p>&nbsp;</p>', '412', 'published');
INSERT INTO `notice` VALUES ('69', '2019-02-11 00:00:00', '工会', '中国联通推荐中央企业系统“全国巾帼文明岗”候选集体结果公示', '<p>根据国资委党建工作局下发的《关于推荐中央企业系统&ldquo;全国巾帼文明岗&rdquo;的通知》的通知精神，经全国女职工委员会委员民主推荐，确定推荐福建省厦门市分公司VIP客户经理团队为中央企业系统&ldquo;全国巾帼文明岗&rdquo;的候选集体。</p>\n<p>现予以公示，公示时间至2019年2月15日。</p>\n<p>公示期间广大员工可通过信函或电子邮件等方式反映公示对象在全国巾帼文明岗必备条件等方面存在的不足和问题。反映不足和问题要坚持实事求是的原则，具体真实，以便调查核实。</p>\n<p>电子邮箱：<a href=\"mailto:jijianjiancha@chinaunicom.cn\"><u>jijianjiancha@chinaunicom.cn</u></a>；</p>\n<p>通信地址：北京市西城区金融大街21号中国联通公司监察局；</p>\n<p>邮政编码：100033。</p>\n<p>&nbsp;</p>', '0', 'draft');
INSERT INTO `notice` VALUES ('70', '2019-02-25 00:00:00', '信息化部', '关于关停、迁移虚拟站点网站的公告', '<p>为落实公司&ldquo;瘦身健体、提质增效&rdquo;的目标，信息化部对历年建设的虚拟站点情况进行了统计分析，计划将一批长期无人使用的站点进行关停操作，将需要继续使用的站点从集团七层机房迁移至西咸云化资源池。</p>\n<p>&nbsp;如有部门需要继续使用附件清单内站点或需保留站点内数据，请在2019年3月1日前联系信息化部。如未在截至时间前联系，信息化部将关闭附件清单内站点，同时不保留站点内数据。</p>\n<p>感谢大家对&ldquo;瘦身健体、提质增效&rdquo;工作的支持。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p style=\"text-align: left;\">信息化部联系人：常沛，66259197,18601105061，<a href=\"mailto:changp3@chinaunicom.cn\"><u>changp3@chinaunicom.cn</u></a></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>附件：虚拟站点清单</p>\n<p>&nbsp;</p>', '83', 'published');
INSERT INTO `notice` VALUES ('71', '2019-04-10 00:00:00', '办公厅', '“沃分享--《天宫-全栈化、大型企业级、私有云平台》《天梯平台总体介绍 》”直播预告', '<p>根据IT人才队伍建设的计划和安排，2018年中国联通党校（学院）会同联通软件研究院开发了天宫系列认证课程，有效促进分子公司的各类应用更好、更快的入驻天宫平台，提高基于天宫平台的应用建设及运维能力。</p>\n<p>为持续推进IT人才队伍培养和IT人才认证工作，中国联通党校（学院）将于近期举办2019年第五期（总第三十三期）&ldquo;沃分享&rdquo;直播公开课，邀请中国联通软件研究院周一峰、尚一多两位老师讲授天宫私有云平台及天梯平台。现将有关事项通知如下。</p>\n<p><strong>一、授课人</strong></p>\n<p>周一峰 联通软件研究院</p>\n<p>--公共平台与架构研发事业部 经理</p>\n<p>尚一多 联通软件研究院</p>\n<p>--创新与合作研发事业部 经理</p>\n<p><strong>二、课程名称及主要内容</strong></p>\n<p>《天宫-全栈化、大型企业级、私有云平台》&mdash; 周一峰</p>\n<p>1.天宫的起源</p>\n<p>2.天宫的体系</p>\n<p>3.天宫的使用</p>\n<p>4.天宫的未来</p>\n<p>《天梯平台总体介绍 》&mdash; 尚一多</p>\n<p>1.DevOps背景及概述</p>\n<p>2.天梯解决方案</p>\n<p>3.天梯实践案例</p>\n<p><strong>三、直播时间及直播平台</strong></p>\n<p>（一）直播时间</p>\n<p>4月 11日下午2：00&mdash;4：00</p>\n<p>（二）直播平台</p>\n<p>1.中国联通网上学院直播中心</p>\n<p>2.&ldquo;中国联通微学堂&rdquo;微信平台。</p>\n<p><strong>&nbsp;&nbsp;&nbsp; 四、参加方式 </strong></p>\n<p>（一）个人可通过微信平台收看直播。关注&ldquo;中国联通微学堂&rdquo;微信公众号，在公众号中点击左下角&ldquo;直播课堂&rdquo;按钮后输入个人云门户OA账号、登录密码即可收看直播。</p>\n<p>（二）各单位可通过网上学院直播中心外接投影仪方式组织集中收看直播。登录云门户，点击&ldquo;应用中心&rdquo;的&ldquo;专业应用&rdquo;，点击&ldquo;网上学院&rdquo;，进入后点击主页顶端主题栏中&ldquo;直播中心&rdquo;，&mdash;并选课收看。集中收看需具备用户权限，各地市分公司网上学院平台管理员可提前与本省分公司网上学院平台管理员联系并添加用户权限，网上学院省分管理员名单详见附件1。请收看直播的人员提前20分钟登陆网上学院&ldquo;直播中心&rdquo;。</p>\n<p><strong>五、直播联系人</strong></p>\n<p>（一）网上学院技术支撑</p>\n<p>陈幼玲，13031165064，chenyouling@parim.net</p>\n<p>（二）联通党校（学院）</p>\n<p>盛锦晖， 18601102912，shengjh@chinaunicom.cn</p>\n<p>邓 &nbsp;青， 18601108009，dengq@chinaunicom.cn</p>\n<p>&nbsp;</p>\n<p>附件:1.省分公司网上学院平台管理员名单</p>\n<p>&nbsp;</p>', '314', 'published');
INSERT INTO `notice` VALUES ('67', '2018-12-18 00:00:00', '信息化部', '关于内网应用清理下线的公告', '<p>为落实公司&ldquo;瘦身健体、提质增效&rdquo;的目标，信息化部对云门户应用中心内应用的使用情况进行了分析。通过梳理后计划采用 &ldquo;关停并转&rdquo;的方式下线一批应用（主要为应用使用率过低、应用数据长时间无更新的老旧应用），下线应用清单见附件。</p>\n<p>如有部门仍在使用附件清单中应用，请在公告期内（截止2018年12月24日）联系信息化部申请暂停下线该应用。公告期结束后，信息化部将安排下线应用。</p>\n<p>下线应用后，计划在2019年1月30日做应用彻底下线（数据删除、服务器回收）。如有部门用户需对下线应用内部数据做保留的，请在2019年1月15日之前联系信息化部申请做数据保留。未申请做数据保留的下线应用数据将随应用彻底下线做数据删除（数据不可恢复）。&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;信息化部联系人：常沛，66259197，changp3@chinaunicom.cn</p>\n<p>&nbsp;</p>', '56', 'published');
INSERT INTO `notice` VALUES ('68', '2018-12-28 00:00:00', '纪检组', '关于集团公司第二批供应商黑名单的公告', '<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">根据《中国联通供应商黑名单管理办法（试行）》的要求，经集团公司总经理办公会议审议通过，现将在全集团范围内禁入的第二批供应商黑名单予以公布（详见附件），禁入起止时间自2018年12月28日起计算。</span></p>\n<p style=\"text-indent: 2em;\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">请各级采购和需求部门在组织招标采购、业务合作过程中，强化对供应商的资格审核，严禁列入黑名单的供应商在禁入期内参与投标或开展新的业务合作。如拒不执行，将按照《中国联通供应商黑名单管理办法（试行）》的规定，严肃追究相关人员的责任。同时，实行供应商黑名单管理是依据公司内部规定对实施了不当行为供应商所采取的措施，请各单位在相关工作中注意把握政策和口径，防止引起不必要的法律纠纷。&nbsp;&nbsp;</span>&nbsp;&nbsp;</p>\n<p style=\"text-indent: 2em;\">&nbsp;</p>\n<p style=\"text-indent: 2em;\"><a href=\"http://www.portal.unicom.local/fileshare/1354949747988cgoy3Iep3Isc1OkfyyEiwJ2Md/download?fid=64524\" target=\"_blank\" rel=\"noopener\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\"><u>附件：集团公司第二批供应商黑名单</u></span> </a></p>\n<p style=\"text-indent: 2em;\">&nbsp;</p>\n<p style=\"text-indent: 2em;\">&nbsp;</p>\n<p style=\"text-indent: 2em;\" align=\"right\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">中国联合网络通信集团有限公司&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-indent: 2em;\" align=\"right\"><span style=\"line-height: 2; font-family: SimSun; font-size: 16pt;\">2018年12月29日&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>', '131', 'published');
INSERT INTO `notice` VALUES ('72', '2019-04-12 00:00:00', '信息化部', '关于组织开展2019年全民国家安全教育日网络安全相关宣传活动的通知', '<p>2015年7月1日，全国人大常委会通过《中华人民共和国国家安全法》，确定每年4月15日为全民国家安全教育日，要求通过多种形式开展国家安全宣传教育活动，增强全民国家安全意识。&nbsp;</p>\n<p>一、维护国家安全是每位公民的神圣义务，网络与信息安全已上升至国家战略高度&nbsp;</p>\n<p>国家安全是指国家独立自主地生存和发展权利、利益的总和，包括国家政治体制不受侵犯；经济发展、民族团结、社会安定不受威胁；国家秘密不被窃取；国家工作人员不被策反；国家机构不被渗透；人民生命、财产不受外来势力的侵犯等。维护国家安全的核心是维护国家核心利益和其他重大利益的安全，包括国家政权、主权、统一和领土完整、人民福祉、经济社会可持续发展以及国家其他重大利益的安全。&nbsp;</p>\n<p>2014年4月，在中央网络安全和信息化领导小组第一次会议上，习近平总书记指出，&ldquo;没有网络安全就没有国家安全&rdquo;。2018年4月，在全国网络安全和信息化工作会议上，习近平总书记深入阐述了网络强国战略思想，清晰的描绘出网络强国的宏伟愿景，网络与信息安全已成为国家安全的重要组成部分。&nbsp;</p>\n<p>二、做好网络与信息安全工作是维护国家安全和社会稳定的重要责任，更是促进公司健康发展和改善服务的必要手段&nbsp;</p>\n<p>要深入贯彻习近平总书记网络强国战略思想、习近平总书记在省部级主要领导干部坚持底线思维着力防范化解重大风险专题研讨班上的重要讲话精神，全面落实全国网信工作会议要求，以落实《网络安全法》为主线，围绕公司互联网化转型，统筹把握安全与发展，突出抓好网络基础设施安全、信息系统安全、数据安全、重大活动保障、专项行动等工作，坚决维护国家安全。&nbsp;</p>\n<p>各单位要结合工作实际，在4&middot;15全民国家安全教育日集中组织开展网络与信息安全专题教育活动，积极宣传先进人物和典型事迹，进一步加强弱口令、钓鱼网站、恶意程序等常见信息安全问题教育，提升全员网络与信息安全意识。&nbsp;</p>\n<p>&nbsp;</p>\n<p>联系人：赵晨斌，010-66258991，zhaocb11@chinaunicom.cn</p>\n<p style=\"text-align: right;\">&nbsp;</p>\n<p style=\"text-align: right;\">信息安全部&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </p>\n<p style=\"text-align: right;\">2019年4月&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>&nbsp;</p>', '129', 'published');
INSERT INTO `notice` VALUES ('73', '2019-04-26 00:00:00', '人力资源部', '联通大数据有限公司公开招聘启事', '<p><strong>联通大数据有限公司公开招聘启事</strong>&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;因公司业务发展需要，本着内部优先，公平竞争的原则，对公司现有空缺岗位进行公开招募。&nbsp;</p>\n<p><strong>一、招聘岗位</strong>&nbsp;&nbsp;</p>\n<table style=\"width: 90%; border-collapse: collapse;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\"><strong>序号</strong></td>\n<td style=\"width: 33.3333%; text-align: center;\"><strong>招聘岗位</strong>&nbsp;</td>\n<td style=\"width: 33.3333%; text-align: center;\"><strong>招聘人数</strong>&nbsp;</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">1</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>能力开放运维岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">3</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">2</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>能力开放运营岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">3</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">3</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>数据建模岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">5</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">4</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>大数据开发岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">5</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">5</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>Python高级开发岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">5</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">6</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>大数据高级开发岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">4</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">7</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>Web前端/可视化开发岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">2</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">8</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>数据生产运维岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">2</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">9</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>基础设施运维岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">3</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">10</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>Java应用开发岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">11</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">11</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>质量管理岗QA&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">2</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">12</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>项目管理岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">2</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">13</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>BOSS系统运营岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">3</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">14</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>合作伙伴招募岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">3</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">15</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>计费结算岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">4</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">16</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>业务规划岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">12</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">17</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>区域拓展岗(本部)&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">8</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">18</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>区域拓展岗（驻江苏分公司）&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">4</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">19</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>区域拓展岗（驻山东分公司）&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">4</td>\n</tr>\n<tr>\n<td style=\"width: 33.3333%; text-align: center;\">20</td>\n<td style=\"width: 33.3333%; text-align: center;\" width=\"358\">\n<p>调研督办岗&nbsp;</p>\n</td>\n<td style=\"width: 33.3333%; text-align: center;\">6</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p><strong>二、工作地点</strong>&nbsp;</p>\n<p><strong>北京</strong>、<strong>江苏、山东</strong>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>三、报名条件</strong>&nbsp;&nbsp;</p>\n<p>1.教育条件：应聘人员应具备全日制本科及以上学历。&nbsp;&nbsp;</p>\n<p>2.年龄条件：应聘人员年龄原则上不超过35岁，特别优秀可适当放宽。&nbsp;</p>\n<p>3.综合考评条件：近3年综合考评结果为称职及以上。&nbsp;</p>\n<p>4.应聘人在过往工作中无违规违纪行为。&nbsp;</p>\n<p>除上述基本条件外，应聘人员还应符合应聘岗位具体资格要求。&nbsp;&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>四、招聘程序</strong>&nbsp;&nbsp;</p>\n<p>招聘信息发布、个人报名、简历筛选、资格审查、集中面试、择优入选等程序进行。具体面试时间、地点另行通知。&nbsp;&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>五、报名办法&nbsp;&nbsp;</strong></p>\n<p>报名时间：2019年4月24日-2019年5月31日&nbsp;&nbsp;</p>\n<p>报名方式：应聘者填写<a href=\"http://www.portal.unicom.local/unisxinxifabu/0/default/infopublish/downloadfile/?picid=/files/unisxinxifabu/resource/2019/04/23/20190423160439_84993.docx@%E9%99%84%E4%BB%B6%E4%BA%8C.%E5%BA%94%E8%81%98%E4%BA%BA%E5%91%98%E6%8A%A5%E5%90%8D%E8%A1%A8.docx\"><u>附件二《应聘人员报名表》.docx</u></a>，填写内容务必简洁真实，如有不实则取消应聘资格。报名表请以邮件形式发至<a href=\"mailto:pitf@chinaunicom.cn\"><u>pitf@chinaunicom.cn</u></a>。邮件及报名表标题请注明&ldquo;应聘岗位-所在单位-姓名&rdquo;。例：&ldquo;区域拓展岗-XX公司-王X&rdquo;。&nbsp;&nbsp;</p>\n<p>报名咨询：皮腾飞，010-60905204 &nbsp;&nbsp;18513672168&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>邮箱：<a href=\"mailto:pitf@chinaunicom.cn\"><u>pitf@chinaunicom.cn</u></a>&nbsp;</p>\n<p>&nbsp;</p>', '34', 'published');
INSERT INTO `notice` VALUES ('74', '2019-04-29 00:00:00', '办公厅', '小伙伴们，欢迎围观“青春心向党•建功新时代”中国联通五四主题诗词会', '<p><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" /><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" /><img class=\"wscnph\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" /></p>', '365', 'published');
INSERT INTO `notice` VALUES ('75', '2019-05-09 00:00:00', '人力资源部', '云际智慧科技有限公司空缺岗位招聘启事', '<p>根据工作需要，经研究，云际智慧科技有限公司空缺岗位面向联通系统内进行公开招聘。相关事项如下：</p>\n<p><strong>一、招聘岗位及资格要求</strong>&nbsp;</p>\n<p>具体招聘岗位职责及任职要求详见附件。&nbsp;</p>\n<p><strong>二、应聘条件 </strong></p>\n<p>1.拥护中国共产党的领导，学习贯彻习近平新时代中国特色社会主义思想和十九大精神。&nbsp;</p>\n<p>2.遵守国家的政策、法规，无违法违纪行为。&nbsp;</p>\n<p>3.国家计划内统招全日制本科及以上学历，专业符合应聘岗位要求。&nbsp;</p>\n<p>4.年龄一般不超过40岁,特别优秀的可适度放宽。&nbsp;</p>\n<p>除上述基本条件外，应聘人员还应符合招聘岗位具体资格要求。&nbsp;</p>\n<p><strong>三、招聘流程 </strong></p>\n<p>应聘人员经简历审查合格后，进入面试流程，具体面试时间、地点另行通知。&nbsp;</p>\n<p><strong>四、报名方式</strong>&nbsp;</p>\n<p>1.报名时间：自发布之日起至2019年10月31日。&nbsp;</p>\n<p>2.报名方式：应聘者请将电子版《招聘报名表》（详见附件）及相关学历等复印件发送至hr@icloudge.com（邮件主题注明&ldquo;应聘岗位+姓名+应聘者所在单位名称&rdquo;）。&nbsp;</p>\n<p>3.报名者应对提交材料的真实性负责，凡弄虚作假者，一经查实，即取消应聘资格。&nbsp;</p>\n<p>&nbsp;</p>\n<p>招聘咨询电话：010-66027399转8011。</p>\n<p>&nbsp;</p>', '177', 'published');
INSERT INTO `notice` VALUES ('76', '2019-05-16 00:00:00', '办公厅', '关于开展中国联通产业互联网专业专家级人才和总部产业互联网专业骨干、新锐级人才年审通知', '<p><strong>一、目标</strong></p>\n<p>为考察产业互联网战略人才的履职情况，加强专业人才队伍动态管理，保持队伍活力，根据《关于实施2019年四级专业人才年审工作的通知》人力资源部（通知编号：WTZ2019042900316号）和《中国联通产业互联网和政企销售等专业人才队伍管理办法》（试行）（中国联通【2018】352号文）的相关要求，对已经入选2017年度的全国产业互联网专业专家人才和总部产业互联网专业骨干、新锐人才进行年审。&nbsp;</p>\n<p><strong>二、人员范围</strong>&nbsp;</p>\n<p>参加本次年审人员为：&nbsp;</p>\n<p>1、全国产业互联网专业专家级（B级）人才；&nbsp;</p>\n<p>2、总部产业互联网专业骨干（C级）、新锐（D级）人才。&nbsp;</p>\n<p><strong>三、年审内容及组织流程</strong>&nbsp;</p>\n<p>1、重点考察各级人才在专业带头、专业创新、解决难题等专业线任务完成情况，包括专业线任务完成情况、2018年个人年度绩效考核结果、人才积分、综合评估等维度。&nbsp;</p>\n<p>2、参加人员自行填报《2019年产业互联网战略人才年审信息表》、人才所在单位对个人填报的资料进行审核后，提交至集团产业互联网和政企销售等专业人才工作组。&nbsp;</p>\n<p>3、集团产业互联网和政企销售等专业人才工作组从评审委员库抽取评委，成立本次产业互联网专业评审委员会，对个人提交年审资料依据管理办法的相关规定进行评审、评审结果经集团产业互联网人才工作组集体讨论通过后，向集团人力资源部报备年审结果并通知到人才所属单位记录备案。&nbsp;</p>\n<p><strong>四、注意事项</strong>&nbsp;</p>\n<p>1、填报方式：请参加年审人员认真填写《2019年产业互联网战略人才年审信息表》，打印纸质版由所在单位主管领导签字（部门领导及主管副总）、审核单位（部门级）盖章后将扫描件发至工作组指定邮箱。&nbsp;</p>\n<p>2、填报时间：自信息发布之日起至2019年5月25日24时止，逾期不再受理申报。未在规定时间内进行申报人员，视为自动放弃本次年审资格及战略人才身份。&nbsp;</p>\n<p>3、请将《2019年产业互联网战略人才年审信息表》盖章原件通过快递或交至：</p>\n<p>集团总部A1216室 王宁</p>\n<p>本次信息收集指定电子邮件：<a href=\"mailto:wangning1@chinaunicom.cn\"><u>wangning1@chinaunicom.cn</u></a></p>\n<p>&nbsp;</p>', '446', 'published');
INSERT INTO `notice` VALUES ('77', '2019-05-20 00:00:00', '人力资源部', '菲律宾运营公司总经理招聘启事', '<p>中国联通国际有限公司是专门负责中国联通国际业务拓展、运营和服务的子公司，总部设在香港，在全球拥有32家分支机构。可为全球企业客户提供境内外一体、全球端到端的一揽子综合信息服务，并为境外个人客户提供全球语音及数据服务。</p>\n<p>为满足海外机构工作需要，现面向公司系统内外公开招聘菲律宾运营公司总经理1名，具体如下：</p>\n<p><strong>一、岗位情况</strong></p>\n<p>中国联通（菲律宾）运营有限公司总经理为国际公司中层管理岗位，标准职级相当于联通集团公司职位体系13级，以集团公司外派或市场化方式聘任管理。主要负责带领运营公司团队履行如下职责:</p>\n<p>（一）根据菲律宾运营公司发展规划实施市场经营和业务拓展工作，保证业务收入的完成；</p>\n<p>（二）做好重要商户的关系维护，建立菲律宾运营公司与客户、合作伙伴间沟通渠道，提高菲律宾运营公司在当地市场的影响力；</p>\n<p>（三）组织菲律宾运营公司的日常经营管理、内控工作，包括制定公司规章制度，保证公司管理有序、高效运行；</p>\n<p>（四）根据经营管理需要，合理配置人力资源，做好团队建设和工作效率的提升；</p>\n<p>（五）建立和完善菲律宾运营公司组织结构体系和业务流程体系，并监督其运行情况；</p>\n<p>（六）维护菲律宾运营公司在当地的形象，遵守当地法律法规、职业道德规范及中国联通的规章制度；</p>\n<p>（七）完成国际公司本部下达的其他临时性、阶段性工作和任务。</p>\n<p>二、应聘条件</p>\n<p>（一）基本资格</p>\n<ol>\n<li>爱国爱企，具有较高的道德修养和职业素质，敢于担当、善于作为、诚信自律。</li>\n</ol>\n<p>2．大学本科（学士）及以上学历（学位）。</p>\n<ol start=\"3\">\n<li>了解和熟悉国内及海外通信行业情况，熟悉国际数据业务及产品，具有商企客户拓展工作经验。具有优秀的组织计划及团队管理能力、较强的组织协调能力，以及突出的市场开拓能力。</li>\n</ol>\n<p>4．英语可作为工作语言，具有良好的听说读写水平。</p>\n<p>（二）业绩资格</p>\n<p>近三年个人年度绩效考核结果均为&ldquo;称职&rdquo;及以上。</p>\n<p>（三）履历资格</p>\n<p>满足以下条件之一：</p>\n<ol>\n<li>现职本地网公司中层正职及以上职务管理序列人员；</li>\n<li>联通集团职位体系12级岗位工作满2年；</li>\n<li>联通集团职位体系12级、11级岗位工作累计满5年。</li>\n</ol>\n<p>三、报名及选拔安排</p>\n<p>（一）个人报名</p>\n<p>有意向且符合条件人员请填写《国际公司管理人员招聘报名表》（见附件），并于2019年5月25日24:00之前发至hk-hr@chinaunicom.cn。发送电子邮件的主题、报名表请命名为&ldquo;菲律宾公司总经理_姓名_联通系统员工编码&rdquo;格式。</p>\n<p>（二）竞争选拔</p>\n<p>国际公司将根据实际报名情况，按照国际公司相关制度规定的程序，以面试等方式组织一轮或多轮选拔。</p>\n<p>（三）聘任管理</p>\n<p>意向人选涉及提拔的，将按程序进行组织考察。最终人选以集团公司外派或国际公司当地雇佣方式使用。以集团公司外派方式使用的，应满足集团相关制度要求的英语成绩。</p>\n<p>特此公告。</p>\n<p>&nbsp;</p>', '88', 'published');
INSERT INTO `notice` VALUES ('78', '2019-05-20 00:00:00', '办公厅', '\"沃分享“----“创新头条”及产业互联网重点产品介绍直播预告', '<p>为提升对&ldquo;创新头条&rdquo;的认识，促进产业互联网重点产品推广，中国联通党校（学院）会同产业互联网产品中心将于近期举办2019年第九期（总第三十七期）&ldquo;沃分享&rdquo;直播公开课，邀请五位老师进行&ldquo;创新头条&rdquo;及产业互联网重点产品的介绍分享。现将有关事项通知如下。</p>\n<p><strong>一、课程名称及授课人</strong></p>\n<p>1.《&ldquo;创新头条&rdquo;--为一线支撑，为一线赋能！》</p>\n<p>--集团产业互联网产品中心 胡颖</p>\n<p>2.《智慧党建产品介绍》</p>\n<p>--联通（黑龙江）产业互联网有限公司 杜明轩</p>\n<p>3.《&ldquo;智诚精治&rdquo;城市管理精细化产品全国拓展交流》</p>\n<p>--联通上海分公司产业互联网运营中心 孙明</p>\n<p>4.《社会治理信息平台产品介绍-打造共建共治共享的社会治理格局》</p>\n<p>--联通（山东）产业互联网有限公司 史运振</p>\n<p>5.《智慧河湖长平台产品介绍》</p>\n<p>--联通云粒智慧科技有限公司辛健</p>\n<p><strong>二、直播时间及直播平台</strong></p>\n<p>（一）直播时间</p>\n<p>5月23日 &nbsp;14：00-16：00</p>\n<p>（二）直播平台</p>\n<ol>\n<li>中国联通网上学院直播中心</li>\n</ol>\n<p>&nbsp; 2.&ldquo;中国联通微学堂&rdquo;微信平台</p>\n<p><strong>三、参加方式</strong></p>\n<p>（一）个人可通过微信平台收看直播。关注&ldquo;中国联通微学堂&rdquo;微信公众号，在公众号中点击左下角&ldquo;直播课堂&rdquo;按钮后输入个人云门户OA账号、登录密码即可收看直播。</p>\n<p>（二）各单位可通过网上学院直播中心外接投影仪方式组织集中收看直播。登录云门户，点击&ldquo;应用中心&rdquo;的&ldquo;专业应用&rdquo;，点击&ldquo;网上学院&rdquo;，进入后点击主页顶端主题栏中&ldquo;直播中心&rdquo;，&mdash;并选课收看。集中收看需具备用户权限，各地市分公司网上学院平台管理员可提前与本省分公司网上学院平台管理员联系并添加用户权限，网上学院省分管理员名单详见附件一。</p>\n<p>请收看直播的人员提前20分钟登陆网上学院&ldquo;直播中心&rdquo;。</p>\n<p><strong>四、直播联系人</strong></p>\n<p>（一）网上学院技术支撑</p>\n<p>陈幼玲，13031165064，chenyouling@parim.net</p>\n<p>（二）联通党校（学院）</p>\n<p>盛锦晖， 18601102912，shengjh@chinaunicom.cn</p>\n<p>&nbsp;</p>\n<p>附件:1.省分公司网上学院平台管理员名单</p>', '237', 'published');
INSERT INTO `notice` VALUES ('79', '2019-05-21 00:00:00', '人力资源部', '云际智慧科技有限公司空缺岗位招聘启事（新增）', '<p>根据工作需要，经研究，云际智慧科技有限公司空缺岗位面向联通系统内进行公开招聘。相关事项如下：</p>\n<p><strong>一、云际智慧公司介绍</strong>&nbsp;</p>\n<p>云际智慧科技有限公司成立于2019年1月29日，由中国联通与网宿科技共同出资设立。云际智慧充分整合了中国联通强大的基础网络、遍布全国的营销服务体系，以及网宿在CDN领域领先的技术研发和运营能力，致力于成为5G时代边缘计算能力的提供者，AI时代智慧生活的服务者。云际智慧将专注于CDN、边缘计算、云安全等领域的技术创新，为4K、8K、VR等高清视频产业，以及人工智能领域等提供新一代CDN以及边缘计算能力。同时，面向云计算、互联网、政府、金融、制造等诸多行业及领域，提供CDN及边缘计算能力的开放平台。&nbsp;</p>\n<p><strong>二、招聘岗位及资格要求</strong>&nbsp;</p>\n<p>具体招聘岗位职责及任职要求详见附件。&nbsp;</p>\n<p><strong>三、应聘条件 </strong></p>\n<p>1.拥护中国共产党的领导，学习贯彻习近平新时代中国特色社会主义思想和十九大精神。&nbsp;</p>\n<p>2.遵守国家的政策、法规，无违法违纪行为。&nbsp;</p>\n<p>3.国家计划内统招全日制本科及以上学历，专业符合应聘岗位要求。&nbsp;</p>\n<p>4.年龄一般不超过40岁,特别优秀的可适度放宽。&nbsp;</p>\n<p>除上述基本条件外，应聘人员还应符合招聘岗位具体资格要求。&nbsp;</p>\n<p><strong>四、招聘流程 </strong></p>\n<p>应聘人员经简历审查合格后，进入面试流程，具体面试时间、地点另行通知。&nbsp;</p>\n<p><strong>五、报名方式</strong>&nbsp;</p>\n<p>1.报名时间：自发布之日起至2019年10月31日。&nbsp;</p>\n<p>2.报名方式：应聘者请将电子版《招聘报名表》（附件2）及相关学历等复印件发送至hr@icloudge.com（邮件主题注明&ldquo;应聘岗位+姓名+应聘者所在单位名称&rdquo;）。&nbsp;</p>\n<p>3.报名者应对提交材料的真实性负责，凡弄虚作假者，一经查实，即取消应聘资格。&nbsp;</p>\n<p>招聘咨询电话：010-66027399转8011。</p>\n<p>&nbsp;</p>', '154', 'published');
INSERT INTO `notice` VALUES ('80', '2019-05-22 00:00:00', '办公厅', '2019年中国联通管理创新成果评审实施方案公示', '<div class=\"comment_newsdetail\">\n<div class=\"detail_all\">根据《中国联通企业管理现代化创新成果评审管理办法》（中国联通〔2009〕144号）有关规定，为切实做好2019年集团公司管理创新成果评审工作，集团企业发展部/法律部编制了2019年中国联通管理创新成果评审实施方案。现将该方案（详见附件）予以公示，公示期3天。如有任何意见建议，请在公示期内反馈。 <br /> &nbsp;&nbsp;&nbsp; 联系人：张旭平，18601102779，zhangxuping@chinaunicom.cn</div>\n</div>\n<div class=\"downlist\">\n<p>&nbsp;</p>\n</div>', '123', 'published');
INSERT INTO `notice` VALUES ('81', '2018-08-10 00:00:00', '人力资源部', '中国联通云南省分公司政企客户事业部部分岗位公开竞聘启事', '<p>为有效落实&ldquo;双百行动&rdquo;综合改革，拓宽选人视野，有效支撑公司业务发展，经公司党委会研究，决定面向社会及集团公司系统内合同制员工公开竞聘云南省分公司政企客户事业部总经理及行业总监、产品总监。现将有关事项通知如下：</p>\n<p><strong>一、竞聘原则</strong>&nbsp;</p>\n<p>坚持德才兼备、以德为先、任人唯贤，坚持事业为上、人事相宜，坚持组织认可、出资人认可、市场认可、群众认可；重视实践经验，强调基层历练。</p>\n<p><strong>二、竞聘职位</strong>&nbsp;</p>\n<p>（一）政企客户事业部总经理：1名；</p>\n<p>（二）政企客户事业部行业总监：若干名；</p>\n<p>（三）政企客户事业部产品总监：若干名。</p>\n<p>具体岗位职责详见附件1。</p>\n<p><strong>三、报名资格</strong>&nbsp;</p>\n<p>（一）社会招聘及集团系统内部竞聘人员报名资格</p>\n<p>1、具有较高的政治素质，对党忠诚、勇于创新、治企有方、兴企有为、清正廉洁。有激情，热爱联通事业。中共党员优先。</p>\n<p>2、应具有履行岗位职责所必需的专业知识，对公司战略规划、营销管理、IT系统、业务政策及管理流程有一定了解，具备政企业务市场营销知识、熟悉通信业务及相关技术。</p>\n<p>3、具有较强的综合管理能力、开拓创新能力、团队建设能力，有激情、有思想、想干事，具有强烈的进取心；身体健康，能够承受较大的工作压力。愿意投身于社会化合作改革。</p>\n<p>4、年龄条件：50周岁及以下（1968年11月16日以后出生）。</p>\n<p>5、学历条件：大学本科及以上学历。</p>\n<p>业绩特别优秀者，部分条件可酌情放宽。</p>\n<p>（二）集团系统内部竞聘人员除以上报名资格外，还应具备以下条件：</p>\n<p>1、考核条件：近三年本人年度考核均为&ldquo;称职&rdquo;及以上。</p>\n<p>2、任职及履历条件：</p>\n<p>（1）政企客户事业部总经理：</p>\n<p>集团公司系统内三级副职及以上管理干部，且应具备以下条件之一：</p>\n<p>①三级正职管理岗位现职；</p>\n<p>②三级副职管理岗位现职满2年以上，未满2年的应当在三级副职岗位和四级正职岗位工作累计5年以上。</p>\n<p>（2）政企客户事业部行业总监、产品总监：</p>\n<p>市场线或政企线岗位工作经历1年及以上。</p>\n<p>具有一线实际工作经验者、有多专业岗位任职经验者优先。</p>\n<p><strong>四、薪酬待遇</strong>&nbsp;</p>\n<p>实行市场化薪酬，各岗位年度薪酬如下：</p>\n<p>1、政企客户事业部总经理：&ldquo;保底50万+绩效50万&rdquo;，绩效薪酬50万元与业绩完成情况挂钩。</p>\n<p>2、政企客户事业部行业总监：&ldquo;保底30万+绩效30万+超业绩指标提成上不封顶&rdquo;，绩效薪酬30万元与业绩完成情况挂钩。</p>\n<p>3、政企客户事业部产品总监：&ldquo;保底30万+绩效20万+超业绩指标产品收益分享上不封顶&rdquo;，绩效薪酬20万元与业绩完成情况挂钩。</p>\n<p><strong>五、竞聘程序</strong>&nbsp;</p>\n<p>竞聘工作按照个人报名、资格审查、面试、组织考察/背景调查、聘任等程序进行。</p>\n<p><strong>六、报名方式</strong>&nbsp;</p>\n<p>（一）报名时间</p>\n<p>自信息发布之日起，至2018年11月15日24：00止，逾期不接受报名。</p>\n<p>（二）报名方式</p>\n<p>报名人员根据竞聘岗位任职条件，填写《中国联通云南省分公司公开竞聘报名表》（见附件2，须附照片），将电子版报名表及相关材料扫描件（身份证、学历学位证明等）发送至18669261866@wo.cn（邮件主题注明&ldquo;XXX（报名人姓名）+竞聘岗位&rdquo;）。</p>\n<p>联系人：黄恺&nbsp; 电话：18669261866。</p>\n<p>（三）其他</p>\n<p>报名人员应对提交资料、信息的真实性负责，凡弄虚作假者，一经查实，即取消报名或聘任资格。公司对所有报名人员的信息保密，报名材料恕不退还。</p>\n<p><strong>七、工作监督</strong>&nbsp;</p>\n<p>中国联通云南省分公司纪委负责全程监督。</p>\n<p>监督电话：0871-68168813；</p>\n<p>监督邮箱：<a href=\"mailto:YNLTJB@wo.cn\"><u>YNLTJB@wo.cn</u></a>。</p>\n<p>&nbsp;</p>', '194', 'published');
INSERT INTO `notice` VALUES ('82', '2019-05-22 00:00:00', '人力资源部', '中国联通江西省分公司空缺岗位公开招聘启事', '<p>为全面落实集团公司&ldquo;五新&rdquo;战略部署，加快江西政企创新业务发展，有效推动公司互联网化运营转型，特面向集团公司系统内合同制员工公开招聘江西省分公司系统集成中心副总经理、项目总监、产品经理、解决方案经理、项目经理、系统集成工程师和行业客户经理。现将有关事项通知如下：</p>\n<p><strong>一、基本原则</strong></p>\n<p>（一）德才兼备、以德为先、任人唯贤；</p>\n<p>（二）民主公开、竞争择优、注重实绩；</p>\n<p>（三）重视产业互联网、创新业务项目运营与管理经验</p>\n<p><strong>二、招聘岗位</strong></p>\n<p>（一）系统集成中心副总经理：1名，职级带宽13－15；</p>\n<p>（二）系统集成中心项目总监：1名，职级带宽12－14；</p>\n<p>（三）云计算产品经理：若干名，职级带宽按创新人才体系执行（相当于10-13）；</p>\n<p>（四）大数据产品经理：若干名，职级带宽按创新人才体系执行（相当于10-13）；</p>\n<p>（五）物联网产品经理：若干名，职级带宽按创新人才体系执行（相当于10-13）；</p>\n<p>（六）解决方案经理：若干名，职级带宽按创新人才体系执行（相当于10-13）；</p>\n<p>（七）项目经理：若干名，职级带宽按创新人才体系执行（相当于10-13）；</p>\n<p>（八）系统集成工程师：若干名，职级带宽按创新人才体系执行（相当于10-13）；</p>\n<p>（九）行业客户经理：若干名，职级带宽9－12。</p>\n<p>具体岗位职责及任职资格条件详见附件。</p>\n<p><strong>三、报名条件</strong></p>\n<p>1、具有较高的政治素质，对党忠诚、勇于创新、治企有方、兴企有为、清正廉洁。有激情，热爱联通事业。中共党员优先。</p>\n<p>2、应具有履行岗位职责所必需的专业知识，具备IT、网络、技术、系统集成、政企客户等工作经历，熟悉通信业务及相关技术。</p>\n<p>3、年龄条件：系统集成中心副总经理和项目总监45周岁及以下（1974年6月1日以后出生），其他岗位40周岁及以下（1979年6月1日以后出生）。</p>\n<p>4、学历条件：大学本科及以上学历。</p>\n<p>5、考核条件：近三年本人年度考核均为&ldquo;称职&rdquo;及以上。</p>\n<p>其他具体要求详见附件。</p>\n<p><strong>四、招聘程序</strong></p>\n<p>1、招聘工作按照&ldquo;自愿报名、资格筛选、笔试、面试、资格审核、考察、公示、体检、录用聘任&rdquo;的程序进行。具体笔试与面试时间安排另行通知。</p>\n<p>2、按照公司有关规定，对聘任使用人员实行任职试用期制。</p>\n<p><strong>五、报名方式</strong></p>\n<p>（一）报名时间：自信息发布之日起，报名至2019年6月4日18：00止。</p>\n<p>（二）报名方式：</p>\n<p>采用线上申报方式，登陆联通云门户，在&ldquo;应用中心&rdquo;搜索&ldquo;人力资源2.0&rdquo;，在其中的&ldquo;员工在线服务大厅&rdquo;进入&ldquo;内部人力资源市场&rdquo;，搜索应聘岗位进行报名（请以个人账号登录云门户后报名，以他人账号代为报名视为无效报名）。</p>\n<p><strong>六、其他</strong></p>\n<p>经资格审核通过后，应聘者将进入笔试与面试环节，参加面试时，应聘者须将身份证、工作证、学历证、学位证书等相关材料复印件、原件提交至江西联通人力资源部。应聘者应对提交资料的真实性负责，凡弄虚作假者，一经查实，即取消应聘或聘任资格。</p>\n<p><strong>七、监督</strong></p>\n<p>江西省分公司纪委负责公开招聘工作的全程监督。</p>\n<p>举报电话：0791-82091234。</p>\n<p>举报邮箱：<a href=\"mailto:jx-jijianjiancha@chianunicom.cn\">jx-jijianjiancha@chianunicom.cn</a>。</p>\n<p>&nbsp;</p>\n<p>附件：招聘岗位职责及任职资格条件</p>\n<p>&nbsp;</p>\n<p>中国联通江西省分公司</p>\n<p>&nbsp;</p>', '300', 'published');
INSERT INTO `notice` VALUES ('83', '2019-05-05 00:00:00', '人力资源部', '选人用人专项检查告知书', '<p style=\"text-indent: 30pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 15pt;\"><span style=\"line-height: 1.5;\">按照中央巡视工作统一部署，中央组织部选人用人专项检查组从</span><span style=\"line-height: 1.5;\">5</span><span style=\"line-height: 1.5;\">月</span><span style=\"line-height: 1.5;\">6</span><span style=\"line-height: 1.5;\">日起，对中国联通开展选人用人巡视检查，时间约</span><span style=\"line-height: 1.5;\">14</span><span style=\"line-height: 1.5;\">天左右，检查的主要内容</span><span style=\"line-height: 1.5;\">:</span><span style=\"line-height: 1.5;\">一是坚持党管干部原则情况，二是坚持好干部标准和树立正确用人导向情况，三是执行选人用人政策和制度规定情况，四是遵守组织人事纪律和匡正选人用人风气情况，五是促进干部担当作为情况，六是上一轮选人用人专项检查整改落实情况。</span></span></p>\n<p style=\"text-indent: 30pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 15pt;\"><span style=\"line-height: 1.5;\">现将检查组联系方式函告，有关违规违纪选人用人问题，请及时向我们反映。</span></span></p>\n<p style=\"text-indent: 30pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 15pt;\"><span style=\"line-height: 1.5;\">电话</span><span style=\"line-height: 1.5;\">:010-56739901(</span><span style=\"line-height: 1.5;\">巡视组公布的电话</span><span style=\"line-height: 1.5;\">)</span><span style=\"line-height: 1.5;\">或者</span><span style=\"line-height: 1.5;\">010-12380</span></span></p>\n<p style=\"text-indent: 30pt;\"><span style=\"font-family: 仿宋_GB2312; font-size: 15pt;\"><span style=\"line-height: 1.5;\">邮箱</span><span style=\"line-height: 1.5;\">:</span><span style=\"line-height: 1.5;\">北京市</span><span style=\"line-height: 1.5;\">A04501(</span><span style=\"line-height: 1.5;\">巡视组公布的邮箱</span><span style=\"line-height: 1.5;\">)</span><span style=\"line-height: 1.5;\">或者</span><span style=\"line-height: 1.5;\">www.12380.gov.cn</span></span></p>\n<p style=\"text-indent: 30pt; text-align: right;\"><span style=\"line-height: 1.5; font-family: 仿宋_GB2312; font-size: 15pt;\"><span style=\"line-height: 1.5;\">&nbsp;</span></span></p>\n<p style=\"text-indent: 180pt; text-align: right;\"><span style=\"font-family: 仿宋_GB2312; font-size: 15pt;\"><span style=\"line-height: 1.5;\">&nbsp;&nbsp;&nbsp; 中央组织部选人用人专项检查组&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p>\n<p style=\"text-indent: 232.5pt; text-align: right;\"><span style=\"line-height: 1.5; font-family: 仿宋_GB2312; font-size: 15pt;\">&nbsp;&nbsp;&nbsp;&nbsp; 2019</span><span style=\"font-family: 仿宋_GB2312; font-size: 15pt;\"><span style=\"line-height: 1.5;\">年</span><span style=\"line-height: 1.5;\">5</span><span style=\"line-height: 1.5;\">月</span><span style=\"line-height: 1.5;\">6</span><span style=\"line-height: 1.5;\">日&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p>', '33', 'published');
INSERT INTO `pageproduce` VALUES ('1', '2018-08-08 10:00:00', '5G', 'NB-IOT模组', '硬件组', '3', '模组提供基站与终端通讯端口，从基站或管理平台接收信号，将接收到的数据或指令传输给终端 ，并将终端回馈的数据或指令回传给基站或管理平台。');
INSERT INTO `pageproduce` VALUES ('2', '2019-02-23 16:14:30', 'DSJ', '人力资源系统', '分布式服务组', '3', '提供季度考核成绩、年度考核成绩、晋降档、岗位调整及各项调整和操作的历史纪录查询。\r\n');
INSERT INTO `pageproduce` VALUES ('3', '2019-03-20 11:12:00', 'DSJ', '联通工会', '应用开发组', '4', '搭建福建联通工会、网站、管理后台；通过平台将工会与会员连接起来，分步整合多元化的服务资源，提升工会服务能力及工作效率，不断提高平台运营能力，提高平台的活跃度，将会员服务做深做实，为员工与企业创造价值。');
INSERT INTO `pageproduce` VALUES ('4', '2019-03-28 10:00:00', 'WLW', '智慧消防', '分布式服务组', '2', '从事件处理情况、各报警系统设备状态情况、消防能力综合评估、历史报警情况分析、地图信息、报警提示框以及最新报警消息大体概述管辖单位消防业务现状。');
INSERT INTO `pageproduce` VALUES ('5', '2019-04-02 14:00:00', 'WLW', '智慧路长', '分布式服务组', '3', '为省交通运输厅、设区市交通主管部门、各级路长办公室及县级、镇级路长等相关部门提供统一门户，并按照等级分配不同的操作权限，基于平面地图展示，主要针对道路的各种信息收集，以及直观的可视化处理。');
INSERT INTO `pageproduce` VALUES ('6', '2019-04-06 16:26:16', 'WLW', '智慧农业', '应用开发组', '4', '随着农业现代化进程的不断深入，现代信息产业的蓬勃发展，农业产业与信息产业的深度融合，“智慧农业”应运而生。建设顺昌县智慧农业，实现统一管理，统一调度，信息共享，从而带动农业生产健康有序发展。为了支持项目的运营，我们以“一个管理后台”为中心，三个平台（政府APP、企业APP、消费者APP）为核心来进行系统的建设与运营。');
INSERT INTO `pageproduce` VALUES ('7', '2019-04-11 16:26:46', 'YUN', '桌面云', '桌面云组', '3', '将服务器的计算、存储、网络资源进行虚拟化，集中管理、统一调度、灵活扩展，以达到桌面使用的安全性和灵活性。桌面云产品基于KVM虚拟化架构，通过RDP/SPICE协议实现虚拟机的连接。');
INSERT INTO `pageproduce` VALUES ('8', '2019-04-18 15:44:32', 'WLW', '智慧河长', '网格开发组', '3', '结合GIS地理信息系统、移动互联网、卫星定位系统、云计算、大数据等技术，集成整合水资源、排污口、河道项目管理、举报等各种基础数据，雨情、水质量等监测数据和监控视频，通过河道网格化管理思想，对省市县（市、区）分级管理，打造统一的河长工作平台，形成河道信息综合分析能力，为水资源管理措施制定、水污染防治规划、水环境预警预报、水生态健康评估提供平台技术支撑，实现“互联网+”跨行业水利业务应用。');
